('80742af6-5433-e556-88d0-4e1a7606f2c4', 'VietNam Airline', '2011-07-11 04:04:06', '2011-10-17 03:36:33', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Tổng Công ty Hàng không Việt Nam là một hãng hàng không có uy tín trong khu vực châu Á mạng bay rộng khắp và lịch nối chuyến thuận lợi, đặc biệt là tại Đông Dương. \r\n\r\nMạng đường bay của Vietnam Airlines đã mở rộng đến 19 tỉnh, thành phố trên cả nước và 42 điểm đến quốc tế tại Mỹ, Châu Âu, Úc và Châu Á.\r\n', 0, '1', '+84 4 38730314      ', NULL, 1, 'AIR000001', 1),
('3eb6cf09-c10a-607d-4592-4e7063d809cb', 'Jetstar Pacific Airlines', '2011-09-14 08:20:40', '2011-10-17 03:35:50', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Jetstar Pacific là hãng hàng không lớn thứ hai ở ViệtNam, đồng thời là hãng hàng không giá rẻ duy nhất, được đổi tên từ Pacific Airlines. Có trụ sở tại Sân bay quốc tế Tân Sơn Nhất Tp Hồ Chí Minh. Hãng điều hành các dịch vụ bay chở hành khách và hàng hoá tới các điểm đến trong nước và quốc tế.', 0, '1', '08.6.2914872 /08.6.2738687 /08.6.2738786 ', NULL, 2, 'AIR000002', 2),
('196a78b5-c2c5-001f-f410-4e7064d26499', 'All Nippon Airways', '2011-09-14 08:23:47', '2011-10-17 03:32:19', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Là một hãng hàng không có trụ sở ở Tokyo, Nhật Bản. Đây là hãng hàng không quốc tế và nội địa lớn thứ hai của Nhật Bản sau hãng Japan Airlines và là hãng hàng không chính thức của Universal Studios Japan. Hãng có 49 điểm đến ở Nhật Bản và 22 tuyến quốc tế.', 0, '1', '08.6.2914872 / 08.6.2738687 / 08.6.2738786 ', NULL, 3, 'AIR000003', 3),
('575ccb33-7763-35ba-975d-4e7064dcd699', 'Asiana Airlines', '2011-09-14 08:24:32', '2011-10-17 03:34:52', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Là một trong hai hãng hàng không lớn của Hàn Quốc. Hãng này có trụ sở và trung tâm tại Sân bay Quốc tế Incheon và trung tâm nội địa tại Sân bay quốc tế Gimpo. Hãng có tổng 63 máy bay và bay đến tất cả 77 điểm.', 0, '1', '08.6.2914872/ 08.6.2738687/ 08.6.2738786 ', NULL, 4, 'AIR000004', 4),
('5e8becc4-9ac2-b2c7-5780-4e9ba3c13327', 'Air France', '2011-10-17 03:37:58', '2011-10-17 03:37:58', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Air France là hãng hàng không quốc gia Pháp. Hãng có 237 máy bay và bay tới 183 điểm trên thế giới.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872/  08.6.2738687/  08.6.2738786  ', NULL, 5, 'AIR000005', 5),
('a1d5c1db-8def-c86d-1c0b-4e9ba396dfea', 'British Airways', '2011-10-17 03:39:07', '2011-10-17 03:39:07', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là hãng hàng không lớn nhất của Vương quốc Anh và lớn thứ ba châu Âu, xếp sau Air France-KLM và Lufthansa, với nhiều chuyến bay từ châu Âu vượt Đại Tây Dương. Hãng có tổng 234 máy bay và 222 điểm đến trên toàn quốc.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 /08.6.2738687/ 08.6.2738786 ', NULL, 6, 'AIR000006', 6),
('aec53935-521b-5fb3-c243-4e9ba39e8dc3', 'Cathay Pacific', '2011-10-17 03:40:14', '2011-10-17 03:40:14', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là một hãng hàng không châu Á, trụ sở tại Hồng Kông, vận chuyển hàng hóa và khách đến 102 điểm đến khắp thế giới. Đây là hãng hàng không chính thức của Hồng Kông, hoạt động chính tại Sân bay Quốc tế Hồng Kông. Đây là một trong 5 hãng được Skytrax xếp hạng "5 sao". Cathay Pacific Airways cũng được IATA cấp chứng chỉ IOSA (Kiểm tra An toàn vận hành IATA) do hãng hoạt động an toàn.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872/ 08.6.2738687/ 08.6.2738786 ', NULL, 7, 'AIR000007', 7),
('da4787e2-e1a0-d3f6-451b-4e9ba3d64fd7', 'China Airlines', '2011-10-17 03:41:37', '2011-10-17 03:41:37', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'China Airlines không phải là công ty quốc doanh, nó trực thuộc Quỹ Phát triển Sự nghiệp Hàng không Trung Hoa. Hãng có trụ sở tại Sân bay quốc tế Đào Viên Đài Loan và Đài Bắc. Hãng thực hiện các tuyến bay đi châu Âu, Bắc Mỹ, và châu Đại Dương.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872/ 08.6.2738687 /08.6.2738786 ', NULL, 8, 'AIR000008', 8),
('3ca20d70-03da-15fa-f7bb-4e9ba411c7a1', 'China Southern Airlines', '2011-10-17 03:42:40', '2011-10-17 03:43:11', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là một hãng hàng không có trụ sở tại Quảng Châu, tỉnh Quảng Đông, Cộng hòa Nhân dân Trung Hoa. Hãng hoạt động trên các tuyến nội địa và quốc tế, đây là hãng hàng không lớn nhất về quy mô đội tàu bay châu Á và là hãng lớn nhất Trung Quốc về số lượng khách vận chuyển. ', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 / 08.6.2738687 / 08.6.2738786 ', NULL, 9, 'AIR000009', 9),
('69e2cc21-a08e-9aea-1f29-4e9ba4b33ddc', 'Emirates', '2011-10-17 03:44:06', '2011-10-17 03:44:06', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là một hãng hàng không có trụ sở tại Dubai, Tiểu vương quốc Ả Rập Thống Nhất. Hãng này phục vụ các chuyến bay vận chuyển hành khách theo lịch trình với gần 550 chuyến bay mỗi tuần, phục vụ 87 thành phố và 59 quốc gia tại châu Âu, Bắc Mỹ, Trung Đông, châu Phi, Ấn Độ và châu Á Thái Bình Dương. Các hoạt động vận chuyển hàng hoá được thực hiện dưới tên Emirates SkyCargo. Đại bản doanh hãng đóng tại Sân bay quốc tế Dubai.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 /08.6.2738687 / 08.6.2738786 ', NULL, 10, 'AIR000010', 10),
('70907a3c-c157-f9c6-ec05-4e9ba4a08397', 'Eva Air', '2011-10-17 03:45:03', '2011-10-17 03:45:03', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là một hãng hàng không Đài Loan có trụ sở tại Sân bay quốc tế Đào Viên - Đài Loan gần Đài Bắc, Đài Loan, hoạt động vận chuyển hành khách và hàng hoá đến các điểm tại châu Á, Australia, New Zealand, châu Âu, và Bắc Mỹ. Hãng này là một công ty con của Tập đoàn Evergreen Group.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 / 08.6.2738687/ 08.6.2738786 ', NULL, 11, 'AIR000011', 11),
('321774cd-b80b-88dd-c4af-4e9ba4dab71a', 'Indochina Airlines', '2011-10-17 03:45:54', '2011-10-17 03:45:54', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Đây là hãng hàng không tư nhân thứ hai của Việt Namsau VietJetAir. Hãng khai thác chủ yếu trên các đường bay nội địa. Các đường bay của hãng này trong thời gian đầu là: Đà Nẵng, Hà Nội, Huế, Thành phố Hồ Chí Minh, Đà Lạt, Nha Trang. Sau đó, hãng sẽ khai thác các đường bay quốc tế.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 / 08.6.2738687/ 08.6.2738786 ', NULL, 12, 'AIR000012', 12),
('5228ada5-6dd5-0b27-a0cc-4e9ba591ded1', 'Japan Airlines', '2011-10-17 03:46:41', '2011-10-17 03:46:41', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là hãng hàng không lớn nhất ở châu Á. Đây là 1 trong 2 hãng hàng không châu Á bay đến Mỹ Latin. Hãng có tất cả 232 chiếc máy bay, bay đến 125 điểm và có đội tàu bay Boeing 747 nhiều nhất thế giới.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 / 08.6.2738687 / 08.6.2738786 ', NULL, 13, 'AIR000013', 13),
('8a0f3b59-a3cd-7a07-9429-4e9ba54b4954', 'Korean Air', '2011-10-17 03:47:44', '2011-10-17 03:47:44', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là hãng hàng không lớn nhất châu Á có trụ sở tại Hàn Quốc, hãng hoạt động trên các tuyến bay nối châu Âu, châu Phi, châu Á, Úc, Bắc Mỹ. Có tổng số 122 máy bay, phục vụ đến 107 điểm đến.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 / 08.6.2738687 / 08.6.2738786 ', NULL, 14, 'AIR000014', 14),
('3b698db9-c7f4-a7ac-a742-4e9ba5fb1989', 'Lao Airlines', '2011-10-17 03:48:40', '2011-10-17 03:48:40', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Lao Airlines là một hãng hàng không có trụ sở ở Viêng Chăn, Lào. Đây là hãng hàng không quốc gia của Lào với các tuyến bay Campuchia, Trung Quốc, Thái Lan và ViệtNam. Trụ sở chính của hãng này là Sân bay quốc tế Wattay, Vientiane.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 /08.6.2738687 /08.6.2738786 ', NULL, 15, 'AIR000015', 15),
('ae224f2a-4831-7174-3af0-4e9ba5cecebc', 'Lauda Air', '2011-10-17 03:49:36', '2011-10-17 03:49:36', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Là hãng hàng không của Áo, trụ sở tại Wien. Hãng có căn cứ ở Sân bay quốc tế Wien và là thành viên của StarAlliance. Hãng có chuyến bay đường dài đầu tiên tớiSydney và Melbourne qua Bangkok. Hãng có khoảng 10 chiếc máy bay và bay tới 130 điểm trong 66 nước.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 /08.6.2738687 / 08.6.2738786 ', NULL, 16, 'AIR000016', 16),
('27dd26aa-1e3d-2e4c-3247-4e9ba6a6e105', 'Lion Air', '2011-10-17 03:50:35', '2011-10-28 04:40:49', '58938806-5fdb-a933-0ec4-4e93fc8f4805', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Lion Air là một hãng hàng không tại Jakarta, Indonesia. Hãng có 35 điểm bay nội địa , và các chuyến bay thường xuyên đến Singapore và Malaysia. Tên đầy đủ của hãng PT Lion Mentari Airlines. Trụ sở chính đặt tại Sân bay quốc tế Soekarno-Hatta , Jakarta .', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', '08.6.2914872 / 08.6.2738687 / 08.6.2738786 ', NULL, 17, 'AIR000017', 17);
