ly:" lang="VI">HỢP ĐỒNG HƯỚNG DẪN VIÊN</span></strong></p>\r\n<p class="MsoNormal" style="text-align:center;mso-outline-level: 1" align="center"><span style="line-height: 11px;"><strong><br /></strong></span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt"><span style="mso-bidi-font-size: 10.0pt;line-height:115%;font-family:"> </span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt"> </p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l2 level1 lfo7; tab-stops: list 36.0pt;"> </p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l2 level1 lfo7; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Căn cứ theo yêu cầu và khả năng của  hai bên</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Hôm nay, ngày $contracts_date tháng $contracts_month năm $contracts_year, hai bên gồm:</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">BÊN A</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US">: CARNIVAL CO. LTD</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 3.0cm 106.35pt 10.0cm;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Do $contracts_salutation_a:      $contracts_daidienbena                Chức vụ: $contracts_position_a</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 3.0cm 106.35pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Địa chỉ                :     $contracts_address_a</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 3.0cm 106.35pt 10.0cm;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Điện thoại          :      $contracts_phone_a                 Fax: $contracts_fax</span></p>\r\n<p class="MsoNormal" style="text-align: justify; tab-stops: 3.0cm 106.35pt 10.0cm;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">BÊN B</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US">: HƯỚNG DẪN VIÊN </span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Do $contracts_salutation_b: $contracts_parent_name               Năm sinh:$contracts_birthday </span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Hướng dẫn viên          :$contracts_parent_name</span><span style="font-family: ''Times New Roman'', serif; font-size: 17px;"> </span><span style="font-family: ''Times New Roman'', serif; font-size: 17px;">Số thẻ</span><span style="font-family: ''Times New Roman'', serif; font-size: 17px;">: $contracts_guide_card_no</span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Số CMND           : </span><span style="font-family: ''Times New Roman'', serif; font-size: 17px;">$contracts_passport_no_guide</span><span style="font-family: ''Times New Roman'', serif; font-size: 17px;"> </span><span style="font-family: ''Times New Roman'', serif; font-size: 17px;">Ngày cấp: $contracts_date_issued_guide</span></p>\r\n<p class="MsoNormal" style="page-break-after: avoid; mso-outline-level: 4;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Địa chỉ thường trú :  $contracts_address_b</span></p>\r\n<p class="MsoNormal" style="page-break-after: avoid; mso-outline-level: 3;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Điện thoại              :    $contracts_phone_b</span></p>\r\n<p class="MsoNormal" style="text-align: justify; page-break-after: avoid; mso-outline-level: 4;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">Hai bên đồng ý thỏa thuận theo các điều khoản sau:</span></p>\r\n<p class="MsoNormal" style="text-align: justify; page-break-after: avoid; mso-outline-level: 3;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 1</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US">: TRÁCH NHIỆM BÊN A</span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -36.0pt; mso-list: l6 level2 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">1.1)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Đồng ý giao cho bên B chịu trách nhiệm hướng dẫn đoàn khách như sau:</span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> + Tour: Tham quan $contracts_groupprogracontracts_name</span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Thời gian từ ngày $contracts_start_date_contract</span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> </span><span style="font-size: 13.0pt; font-family: " lang="FR">+ Số lượng khách :$contracts_num_of_cus_guide  khách</span></p>\r\n<p class="MsoNormal"><span style="font-size: 17px;">+ Quốc tịch: Việt Nam</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; page-break-after: avoid; mso-outline-level: 3; mso-list: l6 level2 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">1.2)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Cung cấp chương trình tour.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; page-break-after: avoid; mso-outline-level: 3; mso-list: l6 level2 lfo1; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">1.3)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Thông báo những vấn đề có liên quan đến khách hàng.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; page-break-after: avoid; mso-outline-level: 3; mso-list: l1 level2 lfo2; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">1.3)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Tạm ứng trước một số tiền cần thiết để phục vụ cho đoàn khách.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; page-break-after: avoid; mso-outline-level: 3;"><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US"> <span style="text-decoration: underline;">ĐIỀU 2</span>: TRÁCH NHIỆM BÊN B</span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.1)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Đồng ý nhận hướng dẫn tham quan cho đoàn khách như tại khoản 1.1 của điều 1.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.2)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Thù lao của hợp đồng : $contracts_tongtien</span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> <strong>(Bằng chữ : $contracts_bangchu )</strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Đảm bảo hướng dẫn đoàn khách tham quan đúng lịch trình và chương trình của bên A.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.3)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Phải báo cáo kịp thời cho bên A những phát sinh hoặc vướng mắc. Nếu không báo thì bên B chịu hoàn toàn trước pháp luật.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.4)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Phải thuyết minh đúng theo chương trình và nội dung của tour với mục đích đem lại sự vui tươi, lành mạnh.Tuyệt đối không tuyên truyền những nội dung đi ngược lại chủ trương, đường lối, chính sách của Đảng và Nhà Nước.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.5)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Bên B phải quyết toán tour theo đúng qui định thanh toán của bên A chậm nhất là 02 ngày sau khi tour kết thúc.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.6)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Không được hủy tour trước ngày khởi hành 02 ngày. Trong thường hợp hủy tour bên B bồi thường 50% tiền hợp đồng hướng dẫn </span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l3 level2 lfo3; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.7)<span style="font: 7.0pt "> </span></span><!--[endif]--><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US">Khi quyết tóan tour buộc phải cung cấp đầu đủ các chứng từ hợp lệ mới được nhận công tác phí </span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; page-break-after: avoid; mso-outline-level: 3;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 3</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US">: ĐIỀU KHOẢN CHUNG</span></strong></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l0 level2 lfo4; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">1.3)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Hai bên thực hiện nghiêm túc hợp đồng.</span></p>\r\n<p class="MsoNormal" style="margin-left: 36.0pt; text-align: justify; text-indent: -36.0pt; mso-list: l4 level2 lfo5; tab-stops: list 36.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">2.3)<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Trong quá trình thực hiện có gì vướng mắc được hai bên bà