rif;" lang="EN-US">Sau khi bàn bạc thỏa thuận, hai bên cùng thống nhất ký kết hợp đồng này với các điều khoản sau:</span></p>\r\n<p class="MsoBodyText" style="margin-top: 2.0pt; margin-right: 0cm; margin-bottom: 2.0pt; margin-left: 0cm;"><span style="font-size: 13pt; font-family: Arial, sans-serif;" lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 1</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US">: NỘI DUNG HỢP ĐỒNG</span></strong></p>\r\n<p> </p>\r\n<p> </p>\r\n<p>\r\n<table id="hopdongthuexe" class="table_clone" style="border-collapse: collapse; width: 100%;" border="1" cellspacing="0" cellpadding="0">\r\n<thead> \r\n<tr bgcolor="#EEEEEE">\r\n<th>Loại xe</th><th>Số xe</th><th>Lộ trình</th><th>Thời gian sử dụng</th><th>Đơn giá</th>\r\n</tr>\r\n</thead> \r\n<tbody>\r\n<tr>\r\n<td align="center">$transportcontracts_loaixe</td>\r\n<td align="center">$transportcontracts_soxe</td>\r\n<td align="center">$transportcontracts_lotrinh</td>\r\n<td align="center">$transportcontracts_thoigiansudung</td>\r\n<td align="center">$transportcontracts_dongia</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</p>\r\n<p> </p>\r\n<p> </p>\r\n<p class="MsoNormal" style="margin-right: .9pt; text-align: justify; tab-stops: 496.15pt 18.0cm;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 2:</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US"> PHƯƠNG THỨC THANH TOÁN </span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 36.0pt; text-indent: -9.0pt; mso-list: l2 level1 lfo3; tab-stops: list 45.0pt left 252.0pt 288.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Bên B thanh toán chuyển khoản cho bên A $contracts_hopdongthuexe_percent %.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 36.0pt; text-indent: -9.0pt; mso-list: l2 level1 lfo3; tab-stops: list 45.0pt left 252.0pt 288.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Bằng chữ: $contracts_hopdongthuexe_inword sau khi kết thúc dịch vụ và nhận hóa đơn VAT.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 27.0pt; tab-stops: 252.0pt 288.0pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt; tab-stops: 270.0pt;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 3:</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US"> TRÁCH NHIỆM BÊN A</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 45.0pt; text-indent: -18.0pt; mso-list: l1 level2 lfo1; tab-stops: list 45.0pt left 496.15pt 18.0cm;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: VNI-Korin; mso-fareast-font-family: VNI-Korin; mso-bidi-font-family: VNI-Korin;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Đảm bảo theo yêu cầu : Đúng địa điểm,đúng giờ,an toàn ,văn minh lịch sự,theo lộ trình đã thoả thuận.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 45.0pt; text-indent: -18.0pt; mso-list: l1 level2 lfo1; tab-stops: list 45.0pt left 496.15pt 18.0cm;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: VNI-Korin; mso-fareast-font-family: VNI-Korin; mso-bidi-font-family: VNI-Korin;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Xuất hoá đơn 10% VAT, Phiếu thu .</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 45.0pt; text-indent: -18.0pt; mso-list: l1 level2 lfo1; tab-stops: list 45.0pt;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: VNI-Korin; mso-fareast-font-family: VNI-Korin; mso-bidi-font-family: VNI-Korin;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US">Chịu trách nhiệm : phí cầu đường,máy lạnh suốt tuyến không bao gồm bến bãi.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 27.0pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt; text-align: justify; tab-stops: 496.15pt 18.0cm;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 4:</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US"> TRÁCH NHIỆM BÊN B</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 45.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo2;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: VNI-Korin; mso-fareast-font-family: VNI-Korin; mso-bidi-font-family: VNI-Korin;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Sử dụng xe đúng theo những luật pháp qui định hiện hành.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 45.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo2;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: VNI-Korin; mso-fareast-font-family: VNI-Korin; mso-bidi-font-family: VNI-Korin;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Nếu bên B sử dụng xe ngoài tuyến đường đã thoả thuận thì bên B thanh toán chi phi phát sinh tuỳ theo tuyến đường cụ thể (Có xác nhận hai bên).</span></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 45.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo2;"><!--[if !supportLists]--><span style="font-size: 13.0pt; font-family: VNI-Korin; mso-fareast-font-family: VNI-Korin; mso-bidi-font-family: VNI-Korin;" lang="EN-US">-<span style="font: 7.0pt "> </span></span><!--[endif]--><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Chỉ sử dụng xe chở khách,không dùng chở hàng hoá,hàng cấm.</span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt; text-align: justify;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt; text-align: justify; tab-stops: 496.15pt 18.0cm;"><strong><span style="text-decoration: underline;"><span style="font-size: 13.0pt; font-family: " lang="EN-US">ĐIỀU 5:</span></span></strong><strong><span style="font-size: 13.0pt; font-family: " lang="EN-US"> ĐIỀU KHOẢN CHUNG</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 0cm; margin-right: .9pt; margin-bottom: .0001pt; margin-left: 36.0pt; text-indent: -36.0pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Hai bên cam kết và tôn trọng hợp đồng và thực hiện hợp đồng này theo đúng quy định của Nhà Nước Việt nam.Mọi sự thay đổi của hợp đồng phải được thành lập thành văn bản và có chữ ký hai bên.Trong trường hợp đơn phương huỷ bỏ hợp đồng,thời gian báo trước cho bên kia ít nhất là 01 ngày.</span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Hiệu lực hợp đồng kể từ ngày ký đến hết ngày thanh lý hợp đồng.</span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> Hợp Đồng được thành lập thành 02 bản,mỗi bên giữ 01 bản có giá trị pháp lý như nhau.</span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt;"><span style="font-size: 13.0pt; font-family: " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-right: .9pt; text-align: center;" align="center">\r\n<table class="MsoTableGrid" style="margin-left:41.4pt;border-collapse:collapse;border:none;mso-yfti-tbllook:  480;mso-padding-alt:0cm 5.4pt 0cm 5.4pt;mso-border-insideh:none;mso-border-insidev:  none" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="height: 138.6pt;">\r\n<td style="width: 207pt; padding-top: 0cm; padding-right: 5.4pt; padding-bottom: 0cm; padding-left: 5.4pt; height: 138.6pt;" width="276" valign="top">\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;   margin-bottom:2.0pt;margin-left:0cm;text-align:center;tab-stops:45.0pt" align="center"><strong><span style="font-size: 13pt; " lang="EN-US">ĐẠI DIỆN BÊN B</span></strong></p>\r\n</td>\r\n<td style="width: 248.4pt; padding-top: 0cm; padding-right: 5.4pt; padding-bottom: 0cm; padding-left: 5.4pt; height: 138.6pt;" width="331" valign="top">\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;   margin-bottom:2.0pt;margin-left:0cm;text-align:center;tab-stops:45.0pt" align="center"><strong><span style="font-size: 13pt; " lang="EN-US">ĐẠI DIỆN BÊN A</span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;   margin-bottom:2.0pt;margin-left:0cm;text-align:center;tab-stops:45.0pt" align="center"><strong></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0p