="EN-US">Địa chỉ<span style="mso-tab-count: 1;">                   </span>: $contracts_address_b</span><!--[if supportFields]><span\r\nlang=EN-US style=''background:yellow;mso-highlight:yellow''><span\r\nstyle=''mso-element:field-begin''></span> MERGEFIELD "iProvince" </span><![endif]--><!--[if supportFields]><span\r\nlang=EN-US style=''background:yellow;mso-highlight:yellow''><span\r\nstyle=''mso-element:field-end''></span></span><![endif]--></p>\r\n<p class="MsoNormal" style="margin-left: .25in; tab-stops: 1.5in 261.0pt;"><span lang="EN-US">Mã số thuế<span style="mso-tab-count: 1;">            </span>: $contracts_mst_benb</span><span lang="EN-US"><span style="mso-tab-count: 1;">                           </span> </span><!--[if supportFields]><span lang=EN-US><span style=''mso-element:field-begin''></span><span\r\nstyle=''mso-spacerun:yes''> </span>MERGEFIELD "iPassportDate" </span><![endif]--><!--[if supportFields]><span\r\nlang=EN-US><span style=''mso-element:field-end''></span></span><![endif]--></p>\r\n<p class="MsoNormal" style="margin-left: .25in; tab-stops: 1.5in;"><span lang="EN-US">Điện thoại <span style="mso-tab-count: 1;">            </span>: $contracts_phone_b</span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 1.45pt; margin-bottom: .0001pt; margin-left: 117.35pt; text-indent: -99.35pt; tab-stops: 1.5in;"><span lang="EN-US">Làm đại diện bên B</span></p>\r\n<p class="MsoBodyText" style="margin-top: 6.0pt; margin-right: 0in; margin-bottom: .0001pt; margin-left: 0in;"><span lang="EN-US">Sau khi bàn bạc thỏa thuận, hai bên cùng thống nhất thực hiện các điều khoản sau:</span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .25in; margin-bottom: 6.0pt; margin-left: 0in; text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 1</span></span><span lang="EN-US">: ĐỐI TƯỢNG CỦA HỢP ĐỒNG</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .25in;"><span lang="EN-US">Bên A tổ chức cho bên B chuyến đi Tham <span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; background-position: initial initial; background-repeat: initial initial;">quan $contracts_groupprogracontracts_name kết hợp $contracts_associate </span></span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .25in;"><span lang="EN-US"><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; background-position: initial initial; background-repeat: initial initial;">từ ngày $contracts_start_date_contract <span style="mso-spacerun: yes;"> </span>đến ngày $contracts_end_date_contract </span></span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .25in;"><span lang="EN-US"><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; background-position: initial initial; background-repeat: initial initial;">Tổng cộng : $contracts_num_of_date Ngày $contracts_num_of_night<span style="mso-spacerun: yes;">  </span>Ðêm</span></span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .25in;"><span style="background-color: #ffffff;"><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-position: initial initial; background-repeat: initial initial;" lang="EN-US">Mục đích chuyến đi</span><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-position: initial initial; background-repeat: initial initial;" lang="EN-US"> : $contracts_purpose</span></span><strong style="mso-bidi-font-weight: normal;"></strong></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .25in; margin-bottom: 6.0pt; margin-left: 0in; text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 2</span></span><span lang="EN-US">: TRÁCH NHIỆM CỦA BÊN A<span style="mso-tab-count: 1;">   </span></span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .5in; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">2.1Tổ chức chuyến đi cho bên B theo đúng chương trình như điều 1.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .5in; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">2.2Hướng dẫn bên B làm thủ tục xin visa.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .5in; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">2.3Giữ hộ chiếu của bên B từ khi xin được visa cho đến ngày khởi hành chuyến đi.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .5in; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">2.4Phổ biến cho bên B các qui định về an ninh tại nước đến.</span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .25in; margin-bottom: 6.0pt; margin-left: 0in; text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 3</span></span><span lang="EN-US">: TRÁCH NHIỆM CỦA BÊN B</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 1.45pt; margin-bottom: 2.0pt; margin-left: .5in; text-align: justify; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">3.1 Đáp ứng các yêu cầu về thủ tục giấy tờ do bên A yêu cầu để xin visa. Khởi hành đúng như lịch trình của đoàn, không về sau hoặc thay đổi về trễ hơn trừ lý do thiên tai, lũ lụt, hãng hàng không đình công và cả đoàn đều bị trễ. </span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 1.45pt; margin-bottom: 2.0pt; margin-left: .5in; text-align: justify; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">3.2Đảm bảo cung cấp toàn bộ giấy tờ hợp pháp. Nếu có vi phạm phải chịu trách nhiệm trước pháp luật.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 1.45pt; margin-bottom: 2.0pt; margin-left: .5in; text-align: justify; text-indent: -.25in; tab-stops: .5in;"><span lang="EN-US">3.3Tự chịu trách nhiệm quản lý về hàng hóa, tài sản, sức khoẻ và y tế cá nhân trong suốt chuyến đi.</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0in; margin-bottom: 6.0pt; margin-left: 0in;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 4</span></span><span lang="EN-US"> : GIÁ TRỊ HỢP ĐỒNG</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 1.45pt; margin-bottom: 2.0pt; margin-left: .5in; text-indent: -.25in; tab-stops: .5in 297.0pt;"><strong><span style="text-decoration: underline;"><span lang="EN-US">Giá tour trọn gói:</span></span></strong><em style="mso-bidi-font-style: normal;"><span style="mso-bidi-font-weight: bold;" lang="EN-US"> <span style="mso-tab-count: 1;">                                                              </span>(Áp dụng cho đoàn $contracts_sl_khach_1</span><span style="mso-bidi-font-weight: bold;" lang="EN-US"> trở lên)</span></em></p>\r\n<table id="giatrihopdong" class="table_add" style="border-collapse: collapse; width: 70%;" border="1" cellspacing="0" cellpadding="0">\r\n<thead>\r\n<tr bgcolor="#CCCCCC">\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">Độ Tuổi</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">Số lượng</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">Giá tour</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">Thuế</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">Thành tiền</td>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">$contractvalues_age</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">$contractvalues_num_of_cus</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">$contractvalues_tour_cost</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center">$contractvalues_tax</td>\r\n<td style="border-style: solid; border-width: 0.5px;" align="center"> $contractvalues_money USD</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 1.45pt; margin-bottom: 2.0pt; margin-left: 0in; text-align: justify; tab-stops: .5in;"><span style="background-color: #ffffff;" lang="EN-US"><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-position: initial initial; background-repeat: initial initial;">      Nếu đoàn từ $contracts_sl_khach khách, giá tour: $contracts_gia_tour_1 $contracts_tiente/khách</span></span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 1.45pt; margin-bottom: 2.0pt; margin-left: .25in; text-align: justify; tab-stops: .25in;"><span style="background-color: #ffffff;" lang="EN-US">Khách hàng vui lòng thanh toán bằng $contracts_tiente_usd<span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-position: initial initial; background-repeat: initial initial;">hoặc tiền $contracts_tiente_vnd theo tỉ giá bán của Ngân hàng ngoại thương</span></span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .1in; margin-bottom: 6.0pt; margin-left: 45.35pt; text-indent: -27.35pt; tab-stops: 45.0pt;"><strong><span style="text-decoration: underline;"><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-position: initial initial; background-repeat: initial initial;" lang="EN-US">Bao gồm: </span></span></strong></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: 0.0001pt; margin-left: 0.5in; line-height: 15pt; text-align: left;">$contracts_baogom</p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .1in; margin-bottom: 6.0pt; margin-left: 45.35pt; text-indent: -27.35pt; tab-stops: 45.0pt;"><span style="background-color: #ffffff;"><strong><span style="text-decoration: underline;"><span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-position: initial initial; background-repeat: initial initial;" lang="EN-US">Không bao gồm: </span></span></strong></span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: 0.0001pt; margin-left: 0.5in; line-height: 15pt; text-align: left;">$contracts_khongbaogom</p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: .5in; text-align: justify; line-height: 15.0pt; mso-line-height-rule: exactly;"> </p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: .5in; text-align: justify; line-height: 15.0pt; mso-line-height-rule: exactly;"><span lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-top: 4.8pt; margin-right: .1in; margin-bottom: 4.8pt; margin-left: 45.35pt; mso-para-margin-top: .4gd; mso-para-margin-right: .1in; mso-para-margin-bottom: .4gd; mso-para-margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><strong><span style="text-decoration: underline;"><span lang="EN-US">Ghi chú:</span></span></strong></p>\r\n<p class="MsoNormal" style="text-indent: .25in; tab-stops: 27.0pt 45.0pt;"><span lang="EN-US">- Trẻ em dưới 02 tuổi: $contracts_trepercent</span><span class="MsoCommentReference"><span style="font-size: 8.0pt;" lang="EN-US"><span style="mso-special-character: comment;"> </span></span></span><span lang="EN-US">% giá tour + thuế các loại (ngủ chung với người lớn).<strong></strong></span></p>\r\n<p class="MsoNormal" style="tab-stops: 27.0pt 45.0pt;"><span lang="EN-US"><span style="mso-spacerun: yes;">      </span>- Trẻ em từ 02 tuổi đến dưới 12tuổi $contracts_trepercent_1<span lang="EN-US">giá tour + thuế các loại (ngủ ghép chung với người lớn).<strong></strong></span></span></p>\r\n<p class="MsoNormal" style="tab-stops: 27.0pt 45.0pt;"><span lang="EN-US"><span style="mso-spacerun: yes;">  </span><span style="mso-spacerun: yes;">    </span>- Trẻ em từ 12 tuổi trở lên bằng giá tour người lớn.<strong></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: .25in; tab-stops: .25in 27.0pt;"><span lang="EN-US">- Do chi phí xăng dầu có thể tăng vào thời điểm xuất vé mà không được báo trước. Chúng tôi sẽ xuất trình công văn của hàng không về việc tăng phụ thu (nếu có) và xin đề nghị khách cho tăng giá tương ứng.<strong></strong></span></p>\r\n<p class="MsoNormal" style="tab-stops: 27.0pt 45.0pt;"><span lang="EN-US"><span style="mso-spacerun: yes;">      </span>- Trình tự các điểm tham quan trong chương trình có thể thay đổi tùy theo thời điểm khởi hành.</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0in; margin-bottom: 6.0pt; margin-left: 0in;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 5</span></span><span lang="EN-US"> : ĐIỀU KHOẢN VỀ THANH TOÁN</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .1in; margin-bottom: 6.0pt; margin-left: 45.35pt; text-indent: -27.35pt; tab-stops: 45.0pt;"><strong><span style="mso-bidi-font-style: italic;" lang="EN-US">5.1 Thanh toán làm $contracts_solanthanhtoan<span style="background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; background-position: initial initial; background-repeat: initial initial;"> đợt</span> :</span></strong></p>\r\n<table id="dieukhoanthanhtoan" class="table_add tabDetailViewDF" style="border-collapse: collapse; width: 60%;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;"><fieldset>\r\n<table style="border-collapse: collapse; width: 100%;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px;">$contractconditions_contract_phase - $contractconditions_event Bên B thanh toán cho bên A $contractconditions_percent số tiền là $contractconditions_money $contractconditions_currency</td>\r\n</tr>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px;">Bằng chữ: <strong> $contractconditions_in_word</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</fieldset></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: .1in; margin-bottom: 6.0pt; margin-left: 45.35pt; text-indent: -27.35pt; tab-stops: 45.0pt;"><strong><span style="mso-bidi-font-style: italic;" lang="EN-US">5.2 Hình thức thanh toán :</span></strong></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: .75in; text-align: justify; text-indent: -.25in; mso-list: l0 level1 lfo5; tab-stops: list .75in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Bên A thanh toán hợp đồng bằng tiền mặt hoặc chuyển khoản theo tỉ giá chính thức của $contracts_ten_nganhang tại thời điểm thanh toán.</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0in; margin-bottom: 6.0pt; margin-left: 0in;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 6</span></span><span lang="EN-US"> : ĐIỀU KHOẢN HỦY PHẠT</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span lang="EN-US">6.1<span style="mso-tab-count: 1;">    </span>Nếu bên A hủy chuyến đi : </span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify;"><span lang="EN-US">Cố ý hủy chuyến đi mà không có lý do chính đáng, bên A phải bồi thường cho bên B như sau:</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Ngay sau khi ký hợp đồng <span style="mso-tab-count: 1;">                       </span>: bị phạt 20% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trước ngày khởi hành 07 ngày<span style="mso-tab-count: 1;">                 </span>: bị phạt 40% tổng giá trị hợp đồng </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trước ngày khởi hành 02 – 06 ngày<span style="mso-tab-count: 1;">         </span>: bị phạt 60% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trong vòng 24 tiếng<span style="mso-tab-count: 1;">                                  </span>: bị phạt 80% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify;"><span lang="EN-US">Nếu lý do hoãn hay hủy bỏ chuyến đi rơi vào một trong những nguyên nhân sau đây thì bên A không phải bồi hoàn bất cứ khỏan nào cho bên B.<span style="mso-tab-count: 1;">         </span></span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Các thay đổi không báo trước của hàng hàng không.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Các yếu tố khách quan khác như thời tiết, các ngày nghỉ lễ không báo trước của các Lãnh Sự Quán, Đại Sứ Quán, chiến tranh, đình công….</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify; text-indent: -27.0pt; mso-list: l2 level2 lfo4; tab-stops: list 45.0pt;"><span lang="EN-US"><span style="mso-list: Ignore;">6.2<span style="font: 7.0pt ''Times New Roman'';">        </span></span></span><span lang="EN-US">Nếu bên B hủy chuyến đi :</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify; tab-stops: 45.0pt;"><span lang="EN-US">Trong trường hợp bên B tự ý hủy toàn bộ chuyến đi, bên B sẽ bồi thường cho bên A như sau:</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Ngay sau khi ký hợp đồng<span style="mso-tab-count: 1;">                        </span>: bị phạt 20% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trước ngày khởi hành 07 ngày<span style="mso-tab-count: 1;">                 </span>: bị phạt 40% tổng giá trị hợp đồng </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trước ngày khởi hành 02 – 06 ngày<span style="mso-tab-count: 1;">         </span>: bị phạt 60% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trong vòng 24 tiếng<span style="mso-tab-count: 1;">                                  </span>: bị phạt 80% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify; tab-stops: 45.0pt;"><span lang="EN-US">Trong trường hợp có thành viên bên B không tham gia chuyến đi, bên B sẽ bồi thường cho bên A như sau:</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Ngay sau khi ký hợp đồng<span style="mso-tab-count: 1;">                        </span>: bị phạt 20% giá tour/khách.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trước ngày khởi hành 07 ngày<span style="mso-tab-count: 1;">                 </span>: bị phạt 40% giá tour/khách </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trước ngày khởi hành 02 – 06 ngày<span style="mso-tab-count: 1;">         </span>: bị phạt 60% giá tour/khách.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top: 0in; margin-right: 0in; margin-bottom: .0001pt; margin-left: 1.25in; text-align: justify; text-indent: -.25in; line-height: 15.0pt; mso-line-height-rule: exactly; mso-list: l0 level1 lfo2; tab-stops: list 1.25in left 4.0in;"><span lang="EN-US"><span style="mso-list: Ignore;">-<span style="font: 7.0pt ''Times New Roman'';">          </span></span></span><span lang="EN-US">Trong vòng 24 tiếng<span style="mso-tab-count: 1;">                                  </span>: bị phạt 80% giá tour/khách</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US">Lưu ý : </span></em></strong><span lang="EN-US">Các qui định về thời gian trên đây chỉ áp dụng theo giờ hành chính và ngày làm việc.</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0in; margin-bottom: 6.0pt; margin-left: 0in;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 7</span></span><span lang="EN-US"> : ĐIỀU KHOẢN KHÁC</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span lang="EN-US">7.1 <span style="mso-tab-count: 1;">   </span><span style="color: #000000;">Bên A không chịu trách nhiệm về tinh thần cũng như vật chất do những sự cố khách quan gây ra tại nước du lịch sở tại như: thất thoát hành lý vì bất cứ lý do nào, thiên tai, hạn hán, chiến tranh, xung đột chính trị, đình công, biểu tình, hỏa hoạn, trì hoãn chuyến bay do thời tiết. Trong những trường hợp này bên B phải tự trang trải các khoản phí tổn ngoài ý muốn này. Bên A sẽ cố gắng trong khả năng của mình hỗ trợ cho khách khi có sự cố xảy ra.</span></span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span style="color: #000000;"><span lang="EN-US">7.2 <span style="mso-tab-count: 1;">   </span>Bên A không<span style="mso-spacerun: yes;">  </span>có <span style="mso-spacerun: yes;"> </span>trách nhiệm bồi thường về vấn đề bảo hiểm ( không chi trả các khoản chi phí) nếu có sự cố xảy ra bên A sẽ hỗ trợ B về mặt thủ tục để nộp hồ sơ bảo hiểm. Phần duyệt chi phí và chi trả chi phí<span style="mso-spacerun: yes;">  </span>phát sinh do sự cố sẽ do Bảo hiểm quyết định và thực hiện. </span></span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span style="color: #000000;" lang="EN-US">7.3 <span style="mso-tab-count: 1;">   </span>Bên A không liên đới <span style="mso-spacerun: yes;"> </span>trách nhiệm về các vấn đề liên quan đến sức khoẻ cá nhân, bảo hiểm y tế, nhân mạng, chết chóc. Nếu có sự cố xảy ra , bên A sẽ hỗ trợ giúp đỡ<span style="mso-spacerun: yes;">  </span>bên B trong khả năng tối đa có thể.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span lang="EN-US">7.4 <span style="mso-tab-count: 1;">   </span>Bên A không chịu trách nhiệm trong trường hợp Quý Khách hàng bị từ chối tại cửa khẩu mặc dù quý khách đã có visa (vì một lý do nào đó mà quan chức an ninh không đồng ý cho nhập cảnh), bên A sẽ hỗ trợ về mặt thủ tục cho Quý Khách trong mọi trường hợp đến khi Quý Khách về đến Việt Nam. Bên B sẽ chịu mọi chi phí phát sinh trong trường hợp này.</span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span lang="EN-US">7.5<span style="mso-tab-count: 1;">    </span>Trong trường hợp đoàn đã khởi hành, vì bất kỳ lý do gì mà khách tham dự tour tách đoàn thì các khoản chi phí dịch vụ sẽ không được hoàn trả.</span></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.35pt; text-align: justify; text-indent: -27.35pt; tab-stops: 45.0pt;"><span lang="EN-US">7.6<span style="mso-tab-count: 1;">    </span>Trường hợp đoàn không đủ 10 khách/đoàn thì bên A sẽ tính lại giá tour áp dụng cho đoàn dưới 10 khách.<span style="mso-spacerun: yes;">   </span></span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0in; margin-bottom: 6.0pt; margin-left: 0in;"><strong style="mso-bidi-font-weight: normal;"><span style="text-decoration: underline;"><span lang="EN-US">ĐIỀU 8 </span></span><span lang="EN-US">: ĐIỀU KHOẢN CUỐI</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify; text-indent: -27.0pt; tab-stops: 45.0pt;"><span lang="EN-US">8.1<span style="mso-tab-count: 1;">    </span>Hai bên cam kết thực hiện đầy đủ các điều khoản đã ghi trong hợp đồng, không bên nào được đơn phương sửa đổi hợp đồng nếu không có ý kiến thống nhất của bên kia.Mọi tranh chấp (nếu có) sẽ được giải quyết trên cơ sở hợp tác hai bên cùng có lợi. Nếu không giải quyết được thì việc tranh chấp sẽ do Tòa án TP.HCM giải quyết. </span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify; text-indent: -27.0pt; tab-stops: 45.0pt;"><span lang="EN-US">8.2<span style="mso-tab-count: 1;">    </span>Hợp đồng lập thành 04 bản có giá trị ngang nhau kể từ ngày ký cho đến ngày thứ 15 sau khi kết thúc chuyến đi, mỗi bên giữ 02, bản để cùng thực hiện. </span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 45.0pt; text-align: justify; text-indent: -27.0pt; tab-stops: 45.0pt;"><span lang="EN-US">8.3<span style="mso-tab-count: 1;">    </span>Chương trình du lịch đính kèm được xem như phụ lục của hợp đồng. Chương trình có thể thay đổi thứ tự các điểm tham quan cho phù hợp với tình hình thực tế nhưng số lượng các điểm tham quan không thay đổi.</span></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: .25in; margin-left: 45.0pt; text-align: justify; text-indent: -27.0pt; tab-stops: 45.0pt;"><span lang="EN-US">8.4<span style="mso-tab-count: 1;">    </span>Sau 15 ngày của ngày kết thúc chuyến đi, hợp đồng xem như đã được thanh lý.</span></p>\r\n<div align="right">\r\n<table class="MsoTableGrid" style="margin-left: 41.4pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 480; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="mso-yfti-irow: 0; mso-yfti-firstrow: yes; height: 138.6pt;">\r\n<td style="width: 207.0pt; padding: 0in 5.4pt 0in 5.4pt; height: 138.6pt;" valign="top" width="276">\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US">ĐẠI DIỆN BÊN B</span></strong></p>\r\n</td>\r\n<td style="width: 3.45in; padding: 0in 5.4pt 0in 5.4pt; height: 138.6pt;" valign="top" width="331">\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US">ĐẠI DIỆN BÊN A</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US"> </span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US"> </span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US"> </span></strong></p>\r\n</td>\r\n</tr>\r\n<tr style="mso-yfti-irow: 1; mso-yfti-lastrow: yes;">\r\n<td style="width: 207.0pt; padding: 0in 5.4pt 0in 5.4pt;" valign="top" width="276">\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 14.0pt;" lang="EN-US"><span style="mso-spacerun: yes;"> $contracts_daidienbenb_name</span></span></strong></p>\r\n</td>\r\n<td style="width: 3.45in; padding: 0in 5.4pt 0in 5.4pt;" valign="top" width="331">\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: 0in; margin-bottom: 2.0pt; margin-left: 0in; text-align: center; tab-stops: 45.0pt;" align="center"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 14.0pt;" lang="EN-US">ĐINH KIM PHƯỢNG</span></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p class="MsoNormal" style="margin-top: .25in; margin-right: -.7pt; margin-bottom: .0001pt; margin-left: 0in;"><em style="mso-bidi-font-style: normal;"><span style="text-decoration: underline;"><span style="font-size: 10.0pt;" lang="EN-US">Ghi chú</span></span></em><em style="mso-bidi-font-style: normal;"><span style="font-size: 10.0pt;" lang="EN-US">: Đính kèm chương trình tham quan du lịch.</span></em></p>\r\n<p class="MsoNormal" style="margin-top: 2.0pt; margin-right: .1in; margin-bottom: 2.0pt; margin-left: .5in; text-indent: -.25in; tab-stops: .5in;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 10.0pt;" lang="EN-US">(*) Ngày kết thúc tour là ngày đoàn về đến sân bay $contracts_tensanbay</span></em><span class="MsoCommentReference"><span style="font-size: 8.0pt;" lang="EN-US"><span style="mso-special-character: comment;"> </span></span></span><em style="mso-bidi-font-style: normal;"><span style="font-size: 10.0pt;" lang="EN-US">theo đúng thời gian thể hiện trong điều (1).</span></em></p>', 0, NULL, 'Contracts', '<p>  </p>', '<p><span style="font-size: x-small;"><br /></span></p>', 'TEM000003', 3);
