ops: 108.0pt"><span style="font-size: 13pt; " lang="EN-US">Làm đại diện bên A</span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">BÊN B</span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US"> :<span style="white-space:pre"> $contracts_parent_name</span></span></strong></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:0cm;margin-bottom:0cm; margin-left:18.0pt;margin-bottom:.0001pt;tab-stops:108.0pt"><span style="font-size: 13pt; " lang="EN-US">Do $contracts_salutation_b : $contracts_parent_name</span><strong><span style="font-size:13.0pt; color:blue" lang="EN-US"> </span></strong><span style="font-size: 13pt; " lang="EN-US">Chức vụ : $contracts_position_b</span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:0cm;margin-bottom:0cm; margin-left:117.35pt;margin-bottom:.0001pt;text-indent:-99.35pt;tab-stops:108.0pt"><span style="font-size: 13pt; " lang="EN-US">Địa chỉ                 :$contracts_address_b</span></p>\r\n<p class="MsoNormal" style="margin-left:18.0pt;tab-stops:108.0pt 261.0pt"><span style="font-size:13.0pt;color:#990000" lang="EN-US">Mã số thuế</span><span style="font-size: 13pt; " lang="EN-US"> : </span><!--[if supportFields]><span lang=EN-US style="font-size:13.0pt;color:#990000" mce_style="font-size:13.0pt;color:#990000"><span style="mso-element:field-begin" mce_style="mso-element:field-begin"></span><span style="mso-spacerun:yes" mce_style="mso-spacerun:yes"> </span>MERGEFIELD "iPassport" </span><![endif]--><!--[if supportFields]><span lang=EN-US style="font-size:13.0pt;color:#990000" mce_style="font-size:13.0pt;color:#990000"><span style="mso-element: field-end" mce_style="mso-element: field-end"></span></span><![endif]--><span style="font-size: 13pt; " lang="EN-US"> $contracts_mst_benb </span><span style="font-size:13.0pt;color:#990000" lang="EN-US"> </span><!--[if supportFields]><span lang=EN-US