an style="font-size: 13pt; " lang="EN-US"> Tổng cộng : $contracts_tongtien</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:7.2pt;margin-bottom: 2.0pt;margin-left:18.0pt"><span style="font-size: 13pt; " lang="EN-US">Mục đích chuyến đi : $contracts_purpose</span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:18.0pt;margin-bottom: 6.0pt;margin-left:0cm;text-align:justify"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">ĐIỀU 2</span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US">: TRÁCH NHIỆM CỦA BÊN A </span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:7.2pt;margin-bottom: 2.0pt;margin-left:18.0pt"><span style="font-size:13.0pt" lang="EN-US">Chương trình cụ thể chuyến đi được bên A chuẩn bị và thông báo chi tiết cho bên B trên cơ sở đề nghị của bên B. Cả hai bên cùng ký tên xác nhận chương trình và được đính kèm theo hợp đồng này coi như phụ lục hợp đồng kèm theo.</span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:18.0pt;margin-bottom: 6.0pt;margin-left:0cm;text-align:justify"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">ĐIỀU 3</span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US">: TRÁCH NHIỆM CỦA BÊN B</span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:36.0pt;text-indent:-18.0pt;tab-stops:36.0pt"><span style="font-size:13.0pt" lang="EN-US">3.1 Tuân thủ theo đúng chương trình đã thống nhất với bên A, khởi hành đúng như lịch trình của </span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:36.0pt;text-indent:-18.0pt;tab-stops:36.0pt"><span style="font-size:13.0pt" lang="EN-US"> đoàn, không tự ý tách đoàn.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:36.0pt;t