6px;" align="center">Thành tiền</td>\r\n</tr>\r\n</thead> \r\n<tbody>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;" align="center">$contractvalues_age</td>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;" align="center">$contractvalues_num_of_cus</td>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;" align="center">$contractvalues_tour_cost</td>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;" align="center">$contractvalues_tax</td>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;" align="center">0.00USD</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</p>\r\n<p> </p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:1.45pt;margin-bottom: 2.0pt;margin-left:36.0pt;text-align:justify;text-indent:-18.0pt;tab-stops:36.0pt"><span style="font-size: 13pt; " lang="EN-US">Khách hàng vui lòng thanh toán bằng tiền VNĐ theo tỉ giá bán của $contracts_bank_name</span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:7.2pt;margin-bottom: 6.0pt;margin-left:45.35pt;text-indent:-27.35pt;tab-stops:45.0pt"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">Bao gồm: </span></span></strong></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:36.0pt;margin-bottom:.0001pt;text-align:justify;line-height: 15.0pt;mso-line-height-rule:exactly"><span style="font-size: 13pt; " lang="EN-US"> $contracts_baogom</span></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:7.2pt;margin-bottom: 6.0pt;margin-left:45.35pt;text-indent:-27.35pt;tab-stops:45.0pt"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">Không bao gồm: </span></span></strong></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:36.0pt;margin-bottom:.0001pt;text-align:justify;line-height: 15.0pt;mso-line-height-rule:exactly"><span style="font-size:13.0pt; color:#990000" lang="EN-US"> $contracts_khongbaogom</span></p>\r\n<p class="MsoNormal" style="text-align:justify;text-indent:-.9pt"><strong><span style="text-decoration: underline;"><span style="font-size:13.0pt" lang="EN-US">GIÁ VÉ CHO TRẺ EM: </span></span></strong></p>\r\n<p class="MsoNormal" style="margin-left:36.0pt;text-align:justify;text-indent: -36.0pt;mso-list:l1 level1 lfo2;tab-stops:list 9.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt;font-family:Wingdings;mso-fareast-font-family: Wingdings;mso-bidi-font-family:Wingdings" lang="EN-US">§<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trẻ em từ 12 tuổi trở lên phải mua 1 vé.</span></p>\r\n<p class="MsoNormal" style="margin-left:36.0pt;text-align:justify;text-indent: -36.0pt;mso-list:l1 level1 lfo2;tab-stops:list 9.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt;font-family:Wingdings;mso-fareast-font-family: Wingdings;mso-bidi-font-family:Wingdings" lang="EN-US">§<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trẻ em từ 02 - 11 tuổi mua $contracts_trepercent_1  vé  tour  + thuế các loại(ngủ chung với người lớn).</span></p>\r\n<p class="MsoNormal" style="margin-left:36.0pt;text-align:justify;text-indent: -36.0pt;mso-list:l1 level1 lfo2;tab-stops:list 9.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt;font-family:Wingdings;mso-fareast-font-family: Wingdings;mso-bidi-font-family:Wingdings" lang="EN-US">§<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trẻ em từ 2 tuổi: $contracts_trepercent vé tour</span><span style="font-size: 17px; "> + thuế các loại(ngủ chung với người lớn).</span></p>\r\n<p class="MsoNormal" style="text-align:justify"><em><span style="text-decoration: underline;"><span style="font-size:13.0pt;mso-bidi-font-weight:bold" lang="EN-US">Lưu ý</span></span></em><span style="font-size:13.0pt" lang="EN-US">: </span></p>\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size: 17px; line-height: 20px; ">Trình tự các điểm tham quan trong chương trình có thể thay đổi tùy theo thời điểm khởi hành.</span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 6.0pt;margin-left:0cm"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">ĐIỀU 5</span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US"> : ĐIỀU KHOẢN VỀ THANH TOÁN</span></strong></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:7.2pt;margin-bottom: 6.0pt;margin-left:45.35pt;text-indent:-27.35pt;tab-stops:45.0pt"><strong><span style="font-size: 13pt; " lang="EN-US">5.1 Thanh toán làm $contracts_solanthanhtoan đợt :</span></strong></p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:7.2pt;margin-bottom: 6.0pt;margin-left:45.35pt;text-indent:-27.35pt;tab-stops:45.0pt"> </p>\r\n<div style="margin-top: 8px; margin-right: 8px; margin-bottom: 8px; margin-left: 8px; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; ">\r\n<table id="dieukhoanthanhtoan" class="table_add tabDetailViewDF" style="border-collapse: collapse; width: 1103px;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;"><fieldset> \r\n<table style="border-collapse: collapse; width: 1067px;" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;">$contractconditions_contract_phase - $contractconditions_event Bên B thanh toán cho bên A $contractconditions_percent % số tiền là 0.00 Array</td>\r\n</tr>\r\n<tr>\r\n<td style="border-style: solid; border-width: 0.5px; padding: 2px 6px;">Bằng chữ: <strong>$contractconditions_in_word</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</fieldset></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p> </p>\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:7.2pt;margin-bottom: 6.0pt;margin-left:45.35pt;text-indent:-27.35pt;tab-stops:45.0pt"> </p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:18.0pt;tab-stops:45.0pt"><strong><span style="font-size: 13pt; " lang="EN-US">5.2. Hình thức thanh toán: </span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:18.0pt"><span style="font-size:13.0pt" lang="EN-US">Bên B thanh toán hợp đồng bằng tiền mặt hoặc chuyển khoản theo tỉ giá </span><!--[if supportFields]><span lang=EN-US style="font-size:13.0pt;color:blue" mce_style="font-size:13.0pt;color:blue"><span style="mso-element:field-begin" mce_style="mso-element:field-begin"></span><span style="mso-spacerun:yes" mce_style="mso-spacerun:yes"> </span>MERGEFIELD "IsToRate" </span><![endif]--><!--[if supportFields]><span lang=EN-US style="font-size:13.0pt;color:blue" mce_style="font-size:13.0pt;color:blue"><span style="mso-element:field-end" mce_style="mso-element:field-end"></span></span><![endif]--><span style="font-size:13.0pt" lang="EN-US">tại thời điểm thanh toán.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:18.0pt"><span style="font-size:13.0pt" lang="EN-US">Bên A sẽ xuất hóa đơn giá trị gia tăng cho bên B tương đương trị giá hợp đồng (không bao gồm các khoản thu chi hộ . hóa đơn các phần thu chi hộ  sẽ  do các đơn vị cung cấp xuất trực tiếp cho bên B.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:18.0pt"><span style="font-size:13.0pt" lang="EN-US">Hóa đơn sẽ được phát hành cho các đơn vị thành viên tham gia đoàn theo thông tin do bên B cung cấp (dựa trên phụ lục HĐ).</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:18.0pt;tab-stops:36.0pt 45.0pt"><strong><span style="text-decoration: underline;"><span style="font-size:13.0pt" lang="EN-US">Lưu ý</span></span></strong><strong><span style="font-size:13.0pt" lang="EN-US">:</span></strong><span style="font-size:13.0pt" lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:18.0pt"><span style="font-size:13.0pt" lang="EN-US">Bên B phải thanh toán tất cả các khoản chi phí phát sinh trong chuyến đi (nếu có) bằng tiền mặt hoặc chuyển khoản cho bên A ngay sau khi thanh lý hợp đồng (nếu có khoản này sẽ được thanh toán cùng với đợt thanh toán cuối cùng). Trường hợp bên B thanh toán chậm sau thời gian nói trên, bên B sẽ chịu phạt 0.03 %/ngày tổng số tiền thanh toán chậm cho bên A.<strong></strong></span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 6.0pt;margin-left:0cm"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">ĐIỀU 6</span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US"> : ĐIỀU KHOẢN HỦY PHẠT<span style="text-decoration: underline;"> </span></span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size: 13pt; " lang="EN-US">6.1    Nếu bên A hủy chuyến đi : </span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.0pt;text-align:justify"><span style="font-size:13.0pt" lang="EN-US">Cố ý hủy chuyến đi mà không có lý do chính đáng, bên A phải bồi thường cho bên B như sau:</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Ngay sau khi ký hợp đồng                    : bị phạt 20% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trước ngày khởi hành 07 ngày            : bị phạt 40% tổng giá trị hợp đồng </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trước ngày khởi hành 02 – 06 ngày    : bị phạt 60% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size: 13pt; " lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trong vòng 24 tiếng                               : bị phạt 80% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.0pt;text-align:justify"><span style="font-size:13.0pt" lang="EN-US">Nếu lý do hoãn hay hủy bỏ chuyến đi rơi vào một trong những nguyên nhân sau đây thì bên A không phải bồi hoàn bất cứ khỏan nào cho bên B. </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Các thay đổi không báo trước của hàng hàng không.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Các yếu tố khách quan khác như thời tiết, các ngày nghỉ lễ không báo trước ….</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.0pt;text-align:justify;text-indent:-27.0pt;mso-list:l1 level2 lfo2; tab-stops:list 45.0pt"><!--[if !supportLists]--><span style="font-size: 13pt; " lang="EN-US">6.2<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size: 13pt; " lang="EN-US">Nếu bên B hủy chuyến đi :</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.0pt;text-align:justify;tab-stops:45.0pt"><span style="font-size:13.0pt" lang="EN-US">Trong trường hợp bên B tự ý hủy toàn bộ chuyến đi, bên B sẽ bồi thường cho bên A như sau:</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Ngay sau khi ký hợp đồng                    : bị phạt 20% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trước ngày khởi hành 07 ngày            : bị phạt 40% tổng giá trị hợp đồng </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trước ngày khởi hành 02 – 06 ngày    : bị phạt 60% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trong vòng 24 tiếng                               : bị phạt 80% tổng giá trị hợp đồng.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.0pt;text-align:justify;tab-stops:45.0pt"><span style="font-size:13.0pt" lang="EN-US">Trong trường hợp có thành viên bên B không tham gia chuyến đi, bên B sẽ bồi thường cho bên A như sau:</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Ngay sau khi ký hợp đồng                    : bị phạt 20% giá tour/khách.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trước ngày khởi hành 07 ngày            : bị phạt 40% giá tour/khách </span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trước ngày khởi hành 02 – 06 ngày    : bị phạt 60% giá tour/khách.</span></p>\r\n<p class="MsoBodyTextIndent" style="margin-top:0cm;margin-right:0cm;margin-bottom: 0cm;margin-left:90.0pt;margin-bottom:.0001pt;text-align:justify;text-indent: -18.0pt;line-height:15.0pt;mso-line-height-rule:exactly;mso-list:l0 level1 lfo1; tab-stops:list 90.0pt left 288.0pt"><!--[if !supportLists]--><span style="font-size:13.0pt" lang="EN-US">-<span style="font:7.0pt "> </span></span><!--[endif]--><span style="font-size:13.0pt" lang="EN-US">Trong vòng 24 tiếng                               : bị phạt 80% giá tour/khách</span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 2.0pt;margin-left:45.35pt;text-align:justify;text-indent:-27.35pt;tab-stops: 45.0pt"><strong><em><span style="font-size: 13pt; " lang="EN-US">Lưu ý : </span></em></strong><span style="font-size: 13pt; " lang="EN-US">Các qui định về thời gian trên đây chỉ áp dụng theo giờ hành chính và ngày làm việc.</span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 2.0pt;margin-left:45.35pt;text-align:justify;text-indent:-27.35pt;tab-stops: 45.0pt"><span style="font-size: 13pt; " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 2.0pt;margin-left:45.35pt;text-align:justify;text-indent:-27.35pt;tab-stops: 45.0pt"><span style="font-size: 13pt; " lang="EN-US"> </span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 6.0pt;margin-left:0cm"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">ĐIỀU 7</span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US"> : ĐIỀU KHOẢN KHÁC<span style="text-decoration: underline;"> </span></span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size: 13pt; " lang="EN-US">7.1    Bên A không chịu trách nhiệm về tinh thần cũng như vật chất do những sự cố khách quan : thất thoát hành lý vì bất cứ lý do nào, thiên tai, hạn hán, chiến tranh, xung đột chính trị, đình công, biểu tình, hỏa hoạn, trì hoãn chuyến bay do thời tiết. Trong những trường hợp này bên B phải tự trang trải các khoản phí tổn ngoài ý muốn này.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:45.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size:13.0pt" lang="EN-US">7.2    Bên A không chịu trách nhiệm bồi thường nào về vấn đề bảo hiểm ( không chi trả các khoản chi phí) nếu có sự cố xảy ra bên A sẽ hỗ trợ về mặt thủ tục để nộp hồ sơ bảo hiểm)</span></p>\r\n<p class="MsoNormal" style="margin-top:12.0pt;margin-right:0cm;margin-bottom: 6.0pt;margin-left:0cm"><strong><span style="text-decoration: underline;"><span style="font-size: 13pt; " lang="EN-US">ĐIỀU 8 </span></span></strong><strong><span style="font-size: 13pt; " lang="EN-US">: ĐIỀU KHOẢN CUỐI<span style="text-decoration: underline;"> </span></span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:63.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size: 13pt; " lang="EN-US">8.1    Hai bên cam kết thực hiện đầy đủ các điều khoản đã ghi trong hợp đồng, không bên nào được đơn phương sửa đổi hợp đồng nếu không có ý kiến thống nhất của bên kia.Mọi tranh chấp (nếu có) sẽ được giải quyết trên cơ sở hợp tác hai bên cùng có lợi. Nếu không giải quyết được thì việc tranh chấp sẽ do Tòa án TP.HCM giải quyết. </span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:63.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size: 13pt; " lang="EN-US">8.2    Hợp đồng lập thành 04 bản có giá trị ngang nhau kể từ ngày ký cho đến ngày thứ 15 sau khi kết thúc chuyến đi, mỗi bên giữ 02, bản để cùng thực hiện. </span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:2.0pt; margin-left:63.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size: 13pt; " lang="EN-US">8.3    Chương trình du lịch đính kèm được xem như phụ lục của hợp đồng. Chương trình có thể thay đổi thứ tự các điểm tham quan cho phù hợp với tình hình thực tế nhưng số lượng các điểm tham quan không thay đổi.</span></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;margin-bottom:18.0pt; margin-left:63.35pt;text-align:justify;text-indent:-27.35pt;tab-stops:45.0pt"><span style="font-size: 13pt; " lang="EN-US">8.4    Sau 15 ngày của ngày kết thúc chuyến đi, hợp đồng xem như đã được thanh lý.</span></p>\r\n<div>\r\n<table class="MsoTableGrid" style="margin-left:41.4pt;border-collapse:collapse;border:none;mso-yfti-tbllook:  480;mso-padding-alt:0cm 5.4pt 0cm 5.4pt;mso-border-insideh:none;mso-border-insidev:  none" border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr style="mso-yfti-irow: 0; mso-yfti-firstrow: yes; height: 138.6pt;">\r\n<td style="width: 207.0pt; padding: 0cm 5.4pt 0cm 5.4pt; height: 138.6pt;" width="276" valign="top">\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;   margin-bottom:2.0pt;margin-left:0cm;text-align:center;tab-stops:45.0pt" align="center"><strong><span style="font-size: 13pt; " lang="EN-US">ĐẠI DIỆN BÊN B</span></strong></p>\r\n</td>\r\n<td style="width: 248.4pt; padding: 0cm 5.4pt 0cm 5.4pt; height: 138.6pt;" width="331" valign="top">\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;   margin-bottom:2.0pt;margin-left:0cm;text-align:center;tab-stops:45.0pt" align="center"><strong><span style="font-size: 13pt; " lang="EN-US">ĐẠI DIỆN BÊN A</span></strong></p>\r\n<p class="MsoNormal" style="margin-top:2.0pt;margin-right:0cm;   margin-bottom:2.0pt;margin-left:0cm;text-align:center;tab-stops:45.0pt" align="center"><strong>