('69c0370d-9ec6-5651-e7ae-4e1ebd6b1fb7', 'CAR001', '2011-07-14 09:56:08', '2011-12-05 09:59:11', '58938806-5fdb-a933-0ec4-4e93fc8f4805', '1', NULL, 0, '1', 'ĐINH KIM PHƯỢNG', 'CÔNG TY TNHH VƯƠNG SƠN', '0302089445', ' 0304413217', 'giamdoc', 'giamdoc', '357 Võ Văn Tần, Phường 5, Quận 3, TP.HCM', '50/18 Đường Lò Lu, Ấp Phước Hiệp, Phường Trường Thạnh. Q.9, TP. Hồ Chí Minh', '(08) 3834 2384 – 3834 2385', '+84 08 37301999 ', '                      Toà nhà Metropolitan, 235 Đồng Khởi, Quận 1, TPHCM                                                                                       ', 'HSBC ', '090.004987- 101', '                       Công Ty TNHH MTV DV DL Lễ Hội (Carnival Travel Service Company Limited)                                                                                                                                                                 ', '090-004987- 001', '090.004987- 101', 'ba', 'ong', 'kết hợp tham dự Hội Chợ VIV', 'Hỗ trợ khách hàng tham quan kết hợp tham dự hội chợ', '22/07/2011', '27/11/2011', 14, 7, '2011', '15', 5470.000000, '- Vé máy bay khứ hồi.\r\n- Phí an ninh sân bay, phí xăng dầu, thuế phi trường (107 USD)\r\n- Tiền tip cho hướng dẫn viên và tài xế địa phương (3USD/người/ngày).\r\n- Tiền tip cho hướng dẫn viên và tài xế địa phương (3USD/người/ngày).\r\n- Ăn uống, tham quan, vận chuyển như chương trình.\r\n- Xe tiễn từ khách sạn The Ambassador đến phi trường Bangkok.\r\n- Hướng dẫn viên.\r\n- Bảo hiểm du lịch,mức bồi thường tối đa 50.000USD/ trường hợp (khách dưới 65 tuổi), 25.000USD/ trường hợp (khách từ  65 tuổi trở lên).\r\n- Quà tặng của Carnival: nón, bao da hộ chiếu, ba lô du lịch.', '- Hộ chiếu (còn giá trị ít nhất 06 tháng tính đến ngày trở về Việt Nam)\r\n- Tham quan ngoài chương trình, chi phí cá nhân, hành lý quá cước, giặt ủi, điện thoại ….\r\n- Phụ thu phí xăng dầu tăng tại thời điểm xuất vé (nếu có).\r\n- Đối với khách Việt Kiều Visa Việt Nam (01 lần) phải làm visa nhập cảnh lại Việt Nam 35USD/khách (lấy tại cửa khẩu Tân Sơn Nhất có giá trị 01 tháng/01 lần)\r\n', 290.000000, '14', 'HSBC', 'Năm  nghìn, bốn  trăm  bảy  mươi', 'VƯƠNG VĂN SỰ', 'ĐINH KIM PHƯỢNG', 'CAR001', 'Tân Sơn Nhất', '(08) 3834 2386 – 3833 2837', 'VƯƠNG VĂN SỰ', 3, 2, '30', '75', 2, 'usd', 'vnd', 'usd', 'Hawaii - Đài Loan', 'e47f74c2-e8fa-c4fc-6f87-4e28eefba18c', '3af72f9c-ca6d-a59a-e26f-4eba4b482d4f', 'Outbound', 'Accounts', NULL, '2011-07-22', '2011-11-27', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '                                                         ', NULL, NULL, NULL, NULL),
