('cbee80a0-4eeb-1d29-890c-4eaa2620a5a1', 'Italia', '2011-10-28 03:52:28', '2011-11-28 10:17:28', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Du lịch Italia - 1. Điều kiện tự nhiên\r\nVị trí địa lý: Nằm ở phía Nam Châu Âu, ba mặt giáp Địa Trung Hải, bắc giáp Nam Tư (cũ), Áo, Thuỵ Sỹ, Pháp.\r\n\r\n- Diện tích: 301.338 km2\r\n\r\nDiện tích đất: 294.020 km2\r\n\r\nDiện tích mặt nước: 7.210 km2\r\n\r\n- Tài nguyên thiên nhiên: Than đá, thủy ngân, kẽm, calicacbonat, đá cẩm thạch, barit, a mi ăng, đá bọt, khoáng chữa bệnh, khoáng chất fen spat, lưu huỳnh, khí gas tự nhiên, dầu thô, cá và đất trồng.', 1, '1', NULL, 'chauau', NULL, NULL, NULL, 'DES000021', 21, NULL, 'ITALY'),
('76c3b79b-2711-baea-e30f-4eaa29f02550', 'Paris', '2011-10-28 04:02:08', '2011-11-28 10:24:00', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Paris là thành phố thủ đô của nước Pháp, cũng là trung tâm hành chính của vùng Île-de-France. Nằm ở phía Bắc nước Pháp, khu vực trung tâm của châu Âu, Paris được xây dựng hai bên bờ sông Seine với tâm là đảo Île de la Cité. Đây cũng là nơi hợp lưu của sông Seine và sông Marne.\r\n\r\nParis nằm ở điểm gặp nhau của các hành trình thương mại đường bộ và đường sông, và là trung tâm của một vùng nông nghiệp giầu có. Vào thế kỷ 10, Paris đã là một trong những thành phố chính của Pháp cùng các cung điện hoàng gia, các tu viện và nhà thờ. Từ thế kỷ 12, Paris trở thành một trong những trung tâm của châu Âu về giáo dục và nghệ thuật. Thế kỷ 14, Paris là thành phố quan trọng bậc nhất của Cơ Đốc giáo và trong các thế kỷ 16, 17, đây là nơi diễn ra Cách mạng Pháp cùng nhiều sự kiện lịch sử quan trọng của Pháp và châu Âu. Đến thế kỷ 19 và 20, thành phố trở thành một trong những trung tâm văn hóa của thế giới, thủ đô của nghệ thuật và giải trí.', 0, '1', NULL, 'chauau', NULL, NULL, NULL, 'DES000022', 22, NULL, 'FRANCE'),
