('9ac918fe-5f3f-78cf-fb7a-4e67734fbeaf', 'Menu Trưa Nhà Hàng Phương Đông', '2011-09-07 13:38:23', '2011-10-21 10:11:03', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', '- Gà hấp hành\r\n- Cua rang me\r\n- Lẩu Tôm Hùm', 0, '1'),
('72af5aa3-8770-2c97-7e52-4ea142b3b2db', 'Menu tối Apsara', '2011-10-21 10:01:13', '2011-10-21 10:01:13', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1. Cá da bò sốt bơ chanh\r\n2. Chả ram tôm ram thịt\r\n3. Mực ống cơm chiên giòn\r\n4. Mai ghẹ nhồi thịt ghẹ\r\n5. Tôm sú biển sống hấp nước dừa\r\n6. Sell nướng mỡ hành\r\n7. Lẩu hải sản sống\r\n8. Cơm chiên dương châu\r\n9. Trái cây, khăn lạnh', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b'),
('825165f6-93af-51d7-9bea-4ea145b99f8f', 'Menu Trưa Nhà Hàng Kiti', '2011-10-21 10:10:15', '2011-10-21 10:10:15', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', '-Mì hải sản\r\n-Đậu phụ chiên giòn sốt nấm kiểu Nhật\r\n-Rau muống xào tỏi\r\n-Kem Caramel', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b'),
('b8b0f717-fea8-72b2-e4bf-4ea4c8c1704e', 'Menu Tối Hai Lúa', '2011-10-24 02:08:23', '2011-10-24 02:08:23', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', '-Heo sữa quay 1/2\r\n-Điêu hồng sốt chua ngọt\r\n-Bò nấu tiêu + bánh mì\r\n-Lẩu Thái Lan\r\n-Trái cây thập cẩm', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b'),
('4d8aec61-6ab4-3765-3e8b-4ea4c976c1ba', 'Menu Tối Hanayuki', '2011-10-24 02:10:20', '2011-10-24 02:10:20', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', '-Bò sốt tiêu xanh\r\n-Cá lóc quay chảo\r\n-Giò heo hầm đông cô\r\n-Lẩu cá lăng nấu măng\r\n-Nho Mỹ', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b');
