('c63bd6b8-63a2-c0e6-91af-4e706e628508', 'Windsor Plaza', '2011-09-14 09:07:12', '2011-12-05 06:56:44', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Khai trương vào tháng 11/2004, khách sạn Windsor Plaza là khách sạn sang trọng mới nhất tại Việt Nam với trung tâm mua sắm, khu giải trí và trung tâm tổ chức hội nghị. Ba tầng dưới của tòa nhà là trung tâm mua sắm An Đông Plaza với 1.500 gian hàng, siêu thị, phòng chơi game cùng khu phục vụ bia ngoài trời. Sảnh tầng trệt chuyển tiếp với đại sảnh khách sạn và nhà hàng Café Central tầng 4 qua hệ thống thang máy hiện đại siêu tốc. Các tầng trên là Bar-Karaoke Club 99 trình diễn nhạc sống hàng đêm, nhà hàng Ngân Đình chuyên các món ăn Hoa, khu vực casino, sảnh tổ chức tiệc - hội nghị - hội thảo lớn nhất Thành phố Hồ Chí Minh, phòng massage và thẩm mỹ.\r\n\r\nPhòng ngủ khách sạn bắt đầu từ tầng 9, là nơi lý tưởng để ngắm nhìn thành phố mà không bị cản trở bởi những tòa nhà lân cận. Từ trên đỉnh cao nhất của khách sạn, ngoài phòng tập thể dục và hồ bơi, khách không những ngạc nhiên trước vẻ đẹp toàn cảnh Sài Gòn mà còn bị hấp dẫn bởi các món nướng và hải sản vô cùng đặc sắc do đội ngũ đầu bếp đẳng cấp Quốc tế chế biến.', 0, '1', NULL, NULL, NULL, 405, '5', 'miennam', 'http://www.windsorplazahotel.com', 'hochiminh', NULL, NULL, '+84 08 3833 6688', '+84 08 3833 6688', '18 An Dương Vương, Quận 5, TP Hồ Chí Minh', 'KHS000003', 3, NULL, 3, 2053000, '2011-12-05'),
