('2507ccef-240a-cbe1-ac42-4e7075d91688', 'LEGEND SAIGON', '2011-09-14 09:33:57', '2011-12-05 06:54:17', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', 'Khách sạn Legend Saigon là sự kết hợp hoàn hảo giữa phong cảnh thiên nhiên và kiến trúc độc đáo, là khu nghỉ mát tuyệt vời giúp quý khách cảm nhận được sự sang trọng và yên bình mỗi khi dừng chân nơi đây,khách sạn Legend nằm bên bờ sông Saigon và rất gần với các khu thương mại trung tâm thành phố, đây là nơi lý tưởng để tổ chức các cuộc hội nghị, hội thảo và yến tiệc. Tất cả mọi yêu cầu về trang thiết bị của quý khách đều được đáp ứng đầy đủ, chu đáo', 0, '1', NULL, NULL, NULL, 283, '5', 'miennam', 'http://www.legendsaigon.com', 'hochiminh', NULL, NULL, '+84 08 3 823 3333', '+84 08 3 823 3333', '2A-4A Tôn Đức Thắng, Q. 1, Tp. Hồ Chí Minh ', 'KHS000006', 6, NULL, 6, 2963000, '2011-12-05'),
