('baeb8194-ff7f-0d48-74f6-4edd7c031f8a', 'Viện Hải Dương Học', '2011-12-06 02:24:35', '2011-12-06 02:24:35', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Viện Hải dương học là một trong những cơ sở nghiên cứu khoa học được ra đời sớm nhất ở Việt Nam và được coi là cơ sở lưu trữ hiện vật và nghiên cứu về biển lớn nhất Đông Nam Á.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', NULL, NULL, NULL, NULL, 'LCT000022', 22, 'Nằm ngay bên cảng Nha Trang, cách thành phố 4km về phía nam.', NULL, 15000, '2011-12-06'),
('15d869c7-7cb7-8b56-516f-4edd7e166dbb', 'Tháp bà Ponagar', '2011-12-06 02:32:49', '2011-12-06 02:32:49', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Ngôi đền này được xây dựng trong thời kỳ đạo Hindu (Ấn Độ giáo) đang cường thịnh khi Chăm pa trong giai đoạn có tên gọi là Hoàn Vương Quốc, vì thế tượng nữ thần có hình dạng của Umar, vợ của Shiva.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', NULL, NULL, NULL, NULL, 'LCT000023', 23, 'phường Vĩnh Phước', NULL, 15000, '2011-12-06'),
('5aadb347-8555-037f-a8a4-4edd7f3a90fb', 'Hòn chồng', '2011-12-06 02:34:45', '2011-12-06 02:34:45', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', 'Khu vực này là một bãi đá được xếp chồng lên nhau một cách tự nhiên.', 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', NULL, NULL, NULL, NULL, 'LCT000024', 24, 'phường Vĩnh Phước', NULL, 11000, '2011-12-06'),
