INSERT INTO `quotes` (`id`, `name`, `date_entered`, `date_modified`, `modified_user_id`, `created_by`, `description`, `deleted`, `assigned_user_id`, `service_cost`, `airline_journey`, `airline_ticket_cost`, `total_cost`, `total_cus`, `transport`, `hotel`, `room`, `food`, `guide`, `insurance`, `other`, `not_content`, `surcharge`, `child_cost`, `code`, `autocode`, `sender`, `senddate`) VALUES
('7bacb9e7-be31-4777-feab-4e65a890bbb6', 'Báo Giá Cho SugarCRM', '2011-09-06 04:58:26', '2011-11-11 04:25:37', '183f28d4-bfd4-47ef-3cad-4e940020735b', '1', NULL, 1, '1', 24, 'SGN- Nha Trang - SNG', 345, 369, 50, 'Vé máy bay SNG-NHA-SNG của VietName airline và được thanh toán tại thời điểm xuất vé\r\nXe đón tiễn khách và tham quan theo lịch trình', 'Novotel Nha trang 4* \r\nTiêu chuẩn phòng: Standard: Twin/ double', 'địa điểm: Phòng họp\r\nThời gian: từ 15h30- 18h00\r\nSố lượng: 40 khách\r\nSắp xếp: Kiểu rạp hát (hoặc lớp học)\r\nchuẩn bị: coffee break ( trà,cà phê, trái caay0 hệ thống âm thanh, ánh sáng, màn hình, micros, bục phát biểu, hoa tươi, giấy bút, nước suối đặt phòng họp (01 chai/khách/ngày)', 'Theo chương trình', 'Hướng dẫn viên phục vụ đoàn nhiệt tình và dày dạy kinh nghiệm', 'đoàn được bảo hiểm du lịch suốt tuyến mức bồi thường cao nhất: 10.000.000 đồng/trường hợp', 'Khăn lạnh, nước suối mỗi ngày 1 cái/1chai/ 1 người.', 'ăn uống thêm ngoài chương trình\r\nNước uống ở các bữa ăn chính', NULL, NULL, 'QUO000001', 1, NULL, NULL),
('d62e3357-6d1b-65c2-928c-4e97f058fdaa', 'Báo giá Tour TP.HCM-Đà Nẵng cho Cty Sugar CRM', '2011-10-14 08:19:15', '2011-12-05 02:45:49', '183f28d4-bfd4-47ef-3cad-4e940020735b', '183f28d4-bfd4-47ef-3cad-4e940020735b', NULL, 0, '183f28d4-bfd4-47ef-3cad-4e940020735b', 2400000, 'SGN – DAD - SGN', 3346000, 5746000, 30, 'Xe đời mới máy lạnh, đưa đón quý khách tham quan theo chương trình.\r\nVé máy bay khứ hồi hạng K: SGN – DAD - SGN\r\nGhi chú: Giá vé máy bay được tính tại thời điểm xuất vé.', 'Khách sạn theo hạng vé, 02 - 03 khách/ phòng. \r\nPhòng đầy đủ tiện nghi. Khách sạn 3* bao gồm hoa và trái cây trong phòng thay đổi theo ngày\r\n●       Đà Nẵng: Trendy, Gianny, Saigon Tourane, Bamboo I,…\r\n●       Hội An: Indochine, An Phú, Bạch Đằng, Vạn Lợi, Lotus,…', '●       Phí tham quan các điểm theo chương trình.\r\n●       Vé tham dự các chương trình biểu diễn nghệ thuật.', 'Ăn uống theo như chương trình gồm:\r\n \r\n●       03 bữa ăn sáng buffet tại khách sạn theo hạng vé.\r\n●       07 bữa ăn chính: tiêu chuẩn 80.000đ/ phần/ khách.', 'Hướng dẫn viên theo đoàn nhiệt tình, kinh nghiệm phục vụ đoàn suốt tuyến.', 'Đoàn được bảo hiểm du lịch suốt chuyến đi. Mức bồi thường cao nhất 10.000.000đ/ vụ.', 'Phục vụ khăn lạnh, nước suối mỗi ngày (01 khăn lạnh + 01 chai nước suối/ người/ ngày).', '●       Ăn uống ngoài chương trình.\r\n●       Điện thoại và giặt ủi. Các chi phí vui chơi và giải trí cá nhân khác.', '●       Ngoại Quốc : 550000\r\n●       Phòng Đơn  : 800000', '●                   Trẻ em từ 12 tuổi trở lên phải mua 1 vé.\r\n●                   Trẻ em từ 06 - 11 tuổi mua ½1/2 vé + 75% giá vé máy bay.\r\n●                   Trẻ em từ 05 tuổi trở xuống: không tính vé, gia đình tự lo nhưng 02 người lớn (bố mẹ) chỉ được kèm 01 trẻ em, nếu số trẻ em đi kèm nhiều hơn thì từ em thứ 02 trở lên phải mua ½ vé.\r\n●                   Tiêu chuẩn 1/2 vé: được 1 xuất ăn sáng + 1/2 xuất ăn chính + 01 ghế ngồi và ngủ ghép chung với gia đình.\r\n●                   Tiêu chuẩn bé miễn vé: ngồi trong lòng Bố Mẹ khi đi trên xe, có ghế ngồi và ăn cùng Bố Mẹ tại nhà hàng khi dùng bữa và mọi dịch vụ khác Bố Mẹ phải tự lo (bảo hiểm, khăn lạnh, nón, nước suối...).', 'QUO000002', 2, 'Carnival Co', '2011-11-24'),
