INSERT INTO `tourprograms` (`id`, `deleted`, `date_modified`, `description_pro`, `destination`, `date_time`, `notes`, `tour_id`, `picture`, `parent`, `parent_id`) VALUES
('478208ae-624d-e4f2-227c-4e9e5baf4d87', 0, '2011-12-05 02:55:21', 'Buổi sáng: Quý khách có mặt tại sân bay Tân Sơn Nhất làm thủ tục đáp chuyến bay đi Đà Nẵng.\r\nĐến Đà Nẵng, xe và HDV Carnival Tours đón Quý khách tại sân bay Đà Nẵng, đưa đoàn đến địa điểm dùng bữa trưa với món đặc sản nổi tiếng Đà Nẵng “Bánh tráng thịt heo 2 đầu da & Mì Quảng”.\r\n \r\nBuổi chiều: Đoàn khởi hành đi Hội An – thương cảng của người Chăm thế kỷ thứ II và của Việt Nam từ thế kỷ XVI. Quý khách nhận phòng tại khách sạn, nghỉ ngơi. Sau đó đoàn bách bộ mua sắm tại phố cổ, thưởng thức ca múa nhạc truyền thống và tham quan:\r\n●       Chùa Cầu Nhật Bản\r\n●       Bảo tàng văn hóa Sa Huỳnh\r\n●       Nhà cổ trăm tuổi\r\n●       Hội quán Phước Kiến\r\n●       Xưởng thủ công mỹ nghệ\r\nBuổi tối: Đoàn dùng bữa tối tại nhà hàng, thưởng thức những món đặc sản Hội An: Cao lầu, bánh bao, bánh vạc, hoành thánh.\r\nQuý khách tự do thưởng ngoạn phố cổ Hội An rực rỡ soi bong bên dòng sông Hoài về đêm.\r\n ', 'Hội An', 'NGÀY 01: TP.HCM – ĐÀ NẴNG – HỘI AN ', 'Ăn Trưa – Chiều', '9ffed273-7a90-c217-da64-4e97bb73a1ab', '11-11-2011 10-01-37 SA.png', 'Destinations', '8d1b32e3-672e-3bf6-0936-4e9e3b86c537'),
('7f6c987c-95fb-a857-3bc1-4e9e5bd715d6', 0, '2011-12-05 02:55:21', 'Buổi sáng: Quý khách dùng điểm tâm tại khách sạn. Đoàn lên xe đi đến biển Cửa Đại, đón tàu cao tốc đi Cù Lao Chàm – khu dự trữ sinh quyển Thế giới, gồm cụm đảo ngoài khơi Biển Đông cách Hội An 12 hải lý với các địa điểm:\r\n●       Tham quan chùa Hải Tạng hơn 400 năm tuổi\r\n●       Âu Thuyền – khu vực tránh bão của ngư dân\r\n●       Khu dân cư và các lăng miếu cổ\r\nQuý khách dùng cơm trưa tại nhà hàng Cù Lao Chàm.\r\n\r\nBuổi chiều: Đoàn tiếp tục tham quan:\r\n●       Khu bảo tồn biển tại bãi Bắc\r\n●       Hòn Dài\r\n●       Tham gia các hoạt động lặn biển (snorkeling) khám phá san hô, cá cảnh, câu cá, bắt ốc, giăng lưới, tắm biển,…\r\nXe đưa đoàn về lại Đà Nẵng nhận phòng khách sạn và nghỉ ngơi.\r\nBuổi tối: Quý khách tự do dạo chơi Tp. Đà Nẵng sau bữa cơm tối.', 'Cù Lao Chàm', 'NGÀY 02: CÙ LAO CHÀM – ĐÀ NẴNG', 'Ăn Sáng – Trưa – Chiều', '9ffed273-7a90-c217-da64-4e97bb73a1ab', NULL, 'Locations', '5f856bd0-f804-7e9f-7b56-4e9e416b1567'),
('50b02e8e-0f5a-0e06-0a4f-4e9e4d1d2e16', 0, '2011-11-30 07:44:51', 'Buổi sáng: Xe và HDV Carnival Tours đón Quý khách khởi hành đi Nha Trang. Đoàn dừng lại ăn sáng tại nhà hàng trước khi tiếp tục chuyến hành trình trên QL.1A đi qua các địa danh nổi tiếng: Vựa trái cây Long Khánh – Đồng Nai, thắng cảnh chùa núi Tà Kú, vườn Thanh long trĩu quả Hàm Thuận Nam – Bình Thuận.\r\nQuý khách đến Phan Thiết nghỉ ngơi, ăn trưa. Trên đường đi, đoàn dừng chân ở Cà Nà – một trong những bãi biển đẹp nhất của miền Trung, chụp hình lưu niệm.\r\n \r\nBuổi chiều: Đến Cam Ranh, xe đưa Quý khách vào Nha Trang theo cung đường mới Sông Lô – Hòn Rớ với bãi Dài hoang sơ, hệ thống resort Diamond Bay với sân golf Quốc tế, KDL Hoàn Cầu với tòa nhà hội nghị Diamond Bay – nơi tổ chức đêm chung kết hoa hậu Hoàn Vũ và các cuộc thi sắc đẹp khác của Việt Nam.\r\n \r\nBuổi tối: Đoàn đến Nha Trang. Quý khách dùng bữa tối tại nhà hàng và nhận phòng khách sạn. Quý khách tự do dạo phố biển về đêm.', 'Nha Trang', 'NGÀY 01:TP.HCM – NHA TRANG', 'Ăn Sáng – Trưa – Chiều', '138e171f-901f-6ab9-381f-4e9e4dd014a5', 'flw013.jpg', 'Destinations', 'ccca8ddb-c2bb-8274-e3f4-4e9e3b90a134'),
('4b544f18-b9b9-7aa3-ee16-4e9e4dfa4db6', 0, '2011-11-30 07:44:51', 'Buổi sáng: Sau khi dùng điểm tâm tại khách sạn, xe đưa đoàn tham quan vịnh Nha Trang – một trong 29 vịnh biển đẹp nhất thế giới. Du khách thỏa sức ngắm cảnh làng chài, bãi sạn, hòn Tằm, hòn Tre... Đoàn tiếp tục đến với khu vui chơi giải trí 4* Diamond Bay để tắm biển và chơi các trò chơi trên biển: mô tô nước, dù bay, lướt ván, cuồng thể thao, thuyền chuối... tại bãi tắm Nhũ Tiên. Sau đó, đoàn tham quan khu vui chơi giải trí Wonder Land (Sông Lô) – nơi diễn ra cuộc thi hoa hậu Hoàn Vũ năm 2008.\r\nQuý khách nghỉ trưa và dùng bữa tại nhà hàng.\r\nBuổi chiều: Đoàn tham quan viện Hải Dương Học Nha Trang, tìm hiểu đời sống các sinh vật đại dương. Tiếp tục tham quan KDL 5* Vinpearl Land. Quý khách đi cáp treo băng biển dài hơn 3km, chơi các trò chơi cảm giác mạnh, xem biểu diễn nhạc nước, tắm biển và bơi lội tại hồ bơi lớn nhất Đông Nam Á (chi phí tự túc).\r\nBuổi tối: Quý khách dùng cơm tối tại nhà hàng. Tự do khám phá thành phố biển Nha Trang về đêm.', 'Vinpearl', 'NGÀY 02:DIAMOND BAY – VINPEARL LAND', 'Ăn Sáng – Trưa – Chiều', '138e171f-901f-6ab9-381f-4e9e4dd014a5', '19bong.jpg', 'Locations', 'dc0c0888-c823-ac37-00fa-4e9e3f8615f0'),
('45f51c72-5315-04f1-e31d-4e9e4d02a0bb', 0, '2011-11-30 07:44:51', 'Buổi sáng: Quý khách dùng điểm tâm, sau đó khởi hành đi tham quan KDL Dốc Lết – một trong những bãi biển tuyệt đẹp của Khánh Hòa. Du khách tự do tắm biển và tham gia các trò chơi trên biển: mô tô nước, chèo thuyền, dù lượn,… và thưởng thức hương vị thơm lừng của các món ăn được chế biến từ hải sản tươi sống (chi phí tự túc). Đoàn nghỉ trưa và dùng cơm tại nhà hàng.\r\n \r\nBuổi chiều: Quý khách khởi hành về lại Nha Trang. Trên đường về, đoàn ghé tham quan trung tâm du lịch suối khoáng nóng Tháp Bà với dịch vụ “Ôn tuyển thủy liệu pháp”, ngâm nước khoáng nóng, tắm bùn,… Sau đó, đoàn viếng tháp Bà Ponagar, một công trình kiến trúc của người Chăm cổ, thưởng ngoạn các thắng cảnh nổi tiếng của Thành phố Nha Trang: cầu Xóm Bóng, cầu Hà Ra, núi Cô Tiên, Hòn Chồng,…\r\n \r\nBuổi tối: Quý khách dùng bữa tối tại nhà hàng. Tự do dạo phố biển và tham quan, mua sắm tại chợ đêm Nha Trang.', 'Dốc Lết', 'NGÀY 03:DỐC LẾT – SUỐI KHOÁNG NÓNG THÁP BÀ', 'Ăn Sáng – Trưa – Chiều', '138e171f-901f-6ab9-381f-4e9e4dd014a5', '48377bbb_r001[1].jpg', 'Locations', '56de1c4d-fb00-b758-3a75-4ed35eaa04e8'),
('40101eea-23a8-e249-dad2-4e9e4d7c7f64', 0, '2011-11-30 07:44:51', 'Buổi sáng: Quý khách dùng điểm tâm tại khách sạn, sau đó làm thủ tục trả phòng và khởi hành về lại Tp.HCM. Trên đường về, đoàn ghé nghỉ ngơi và mua sắm đặc sản tại Phan Rang – Ninh Thuận: nho tươi, rượu nho, mật nho, tỏi,… Tiếp tục hành trình về đến Phan Thiết. Đoàn dùng cơm trưa tại Phan Thiết.\r\n \r\nBuổi chiều: Xe đưa Quý khách về điểm đón ban đầu, kết thúc chương trình tham quan. HDV chào tạm biệt và hẹn gặp lại Quý khách.', 'TP. Hồ Chí Minh', ' NGÀY 04:NHA TRANG – TP.HCM', 'Ăn Sáng – Trưa', '138e171f-901f-6ab9-381f-4e9e4dd014a5', '1234408020-bieutuongtinhyeu1.jpg', 'Destinations', '48a55ac2-ffe3-79a5-2f47-4e3249d0fb35'),
('69da8efb-a34f-8e1a-ed85-4e9e4b5793d1', 0, '2011-12-05 02:03:20', 'Buổi sáng: Xe và HDV đón đoàn, khởi hành đi Phan Thiết. Quý khách dừng chân tại nhà hàng, dùng điểm tâm sáng. Sau đó, đoàn theo QL.1A, đi qua các địa danh nổi tiếng: vựa trái cây Long Khánh – Đống Nai, thắng cảnh chùa núi Tà Kú, vườn thanh long trĩu quả Hàm Thuận Nam – Bình Thuận.\r\n \r\nTrên xe, Quý khách tham gia các trò chơi, giao lưu văn nghệ với nhiều phần quà hấp dẫn do HDV tổ chức.\r\n \r\nĐến Phan Thiết, đoàn tham quan khu trung tâm thành phố, di tích Lầu Ông Hoàng. Quý khách tiếp tục dừng chân chụp hình lưu niệm tại bãi đá Ông Địa, rặng dừa Hàm Tiến, ngắm cảnh cập bến của ngư dân tại bãi thuyền Mũi Né.\r\n \r\nQuý khách dùng cơm trưa tại nhà hàng, về khách sạn nhận phòng nghỉ ngơi.\r\n\r\nBuổi chiều: Đoàn ghé thăm Hòn Rơm, tắm biển và thưởng thức hải sản tươi ngon với mức giá bình dân. Quý khách tiếp tục chinh phục đồi cát bay Suối Hồng, thưởng thức dừa “3 nhát” và chiêm ngưỡng cảnh mặt trời lặn trên đồi cát.\r\n \r\nBuổi tối: Sau khi dùng bữa tối, Quý khách tự do dạo phố biển về đêm. Nghỉ đêm tại resort.', 'Phan Thiết', 'NGÀY 01: TP.HCM – PHAN THIẾT   ', 'Ăn Sáng – Trưa- Chiều ', '38f03495-e449-fcee-0f62-4e9e4bb65c86', NULL, 'Destinations', '6b9ab0ee-3e40-4b4e-9a1f-4e9e3b299114'),
('684a86b7-c4a1-d231-7185-4e9e45f35362', 0, '2011-10-19 03:42:15', 'Buổi sáng: Quý khách dùng điểm tâm sáng tại nhà hàng. Tự do tắm biển, ngắm bình minh và nghỉ ngơi tại resort.\r\n \r\nSau đó, Quý khách trả phòng và dùng cơm trưa. Xe đưa đoàn quay về lại Tp.HCM. Trên đường về, Quý khách ghé tham quan và mua sắm đặc sản tại Phan Thiết.\r\n \r\nĐến Hàm Thuận Nam, Quý khách đi cáp treo tham quan KDL Tà Kú, viếng Linh Sơn Trường Thọ, chiêm ngưỡng tượng Phật Thích Ca nhập Niết Bàn dài 49 m – là pho tượng Phật nằm lớn nhất Đông Nam Á. (Chi phí cáp treo tự túc.)\r\n \r\nBuổi chiều: Xe đưa đoàn về lại điểm đón, kết thúc chuyến tham quan. HDV chào tạm biệt và hẹn gặp lại Quý khách.', 'TP. Hồ Chí Minh', 'NGÀY 02: PHAN THIẾT – TÀ KÚ – TP.HCM   ', 'Ăn Sáng – Trưa', '3d75471c-59c9-18ba-7637-4e9e450a20dd', NULL, 'Destinations', '48a55ac2-ffe3-79a5-2f47-4e3249d0fb35'),
('dfee5ff7-7eab-fb3c-1f89-4e97bbf34f3f', 0, '2011-12-05 02:55:21', 'Buổi sáng: Đoàn dùng điểm tâm sáng tại nhà hàng. Sau đó khởi hành đi KDL Bà Nà – Núi Chúa, nơi mà Quý khách có thể khám phá những khoảnh khắc giao mùa (Xuân – Hạ - Thu – Đông) bất ngờ trong cùng một ngày.\r\n●       Chiêm ngưỡng cảnh quan KDL Bà Nà – Núi Chúa trên hệ thống cáp treo dài nhất Thế giới ( tổng chiều dài gần 6.000 m)\r\n●        Tham quan đồi Vọng Nguyệt, chùa Linh Ứng, Thích Ca Phật Đài, khu chuồng ngựa cũ của Pháp, vườn tịnh tâm và đỉnh nhà rông.\r\n●       Tiếp tục ngồi cáp treo đến Đỉnh Nghinh Phong, tham quan biệt thự Lê Nin, lầu Vọng Nguyệt, Cầu treo Bà Nà và chinh phục đỉnh núi Chúa ở độ cao 1.487m so với mực nước biển.\r\nQuý khách dùng cơm trưa tại nhà hàng.\r\n \r\nBuổi chiều: Theo tuyến cáp treo, đoàn quay trở về chân núi và quay lại trung tâm thành phố Đà Nẵng theo đường dọc biển. Quý khách dừng chân tắm biển tại bãi Red Beach nằm trong vịnh Đà Nẵng – nơi chứng kiến cuộc đổ bộ đầu tiên của quân viễn chinh Pháp và Mỹ vào những năm 1858 và 1965.\r\n \r\nBuổi tối: Quý khách tham dự Gala Dinner và tham gia các hoạt động văn nghệ, giao lưu vui nhộn và thú vị. Quý khách tự do khám phá phố biển Đà Nẵng về đêm với Cầu quay sông Hàn, trung tâm thương mại, khu phố ẩm thực, các nhà hàng – Bar – Club,…', 'Bà Nà', 'NGÀY 03: BÀ NÀ – KHOẢNH KHẮC GIAO MÙA', 'Ăn Sáng – Trưa – Chiều', '9ffed273-7a90-c217-da64-4e97bb73a1ab', NULL, 'Locations', 'ac8fa538-cbe7-d258-a34c-4e9514497b28'),
