('6b2aa266-6149-2766-53d9-4e9f89b4a96d', 0, '2011-12-05 02:55:21', 'Buổi sáng: Quý khách dùng điểm tâm tại nhà hàng. Xe đưa đoàn vượt cầu Thuận Phước khởi hành đi bán đảo Sơn Trà (Monkey Mountain). Xe đưa Quý khách dọc theo triền núi Đông Nam để chiêm ngưỡng vẻ đẹp tuyệt mỹ của biển Đà Nẵng. Đoàn viếng Linh Ứng Tự - nơi có tượng Phật Bà 65m cao nhất Việt Nam, tắm biển Mỹ Khê – được tạp chí Forbes bình chọn là 1 trong những bãi biển quyết rũ nhất hành tinh, mua sắm tại siêu thị đặc sản miền Trung.\r\nQuý khách dùng cơm trưa tại nhà hàng.\r\n \r\nBuổi chiều: Xe đưa đoàn ra sân bay Đà Nẵng làm thủ tục đáp chuyến bay về lại Tp.HCM. Đến sân bay Tân Sơn Nhất, xe và HDV đưa đoàn về lại điểm đón ban đầu. Kết thúc chương trình tham quan, chia tay và hẹn gặp lại Quý khách.', 'TP. Hồ Chí Minh', 'NGÀY 04: ĐÀ NẴNG – SƠN TRÀ – TP.HCM', 'Ăn Sáng – Trưa', '9ffed273-7a90-c217-da64-4e97bb73a1ab', NULL, 'Destinations', '48a55ac2-ffe3-79a5-2f47-4e3249d0fb35'),
('ce331521-2eeb-dd03-b6ff-4ea4e0760687', 1, '2011-10-24 03:50:44', 'Buổi sáng: Quý khách dùng điểm tâm tại nhà hàng. Xe đưa đoàn vượt cầu Thuận Phước khởi hành đi bán đảo Sơn Trà (Monkey Mountain). Xe đưa Quý khách dọc theo triền núi Đông Nam để chiêm ngưỡng vẻ đẹp tuyệt mỹ của biển Đà Nẵng. Đoàn viếng Linh Ứng Tự - nơi có tượng Phật Bà 65m cao nhất Việt Nam, tắm biển Mỹ Khê – được tạp chí Forbes bình chọn là 1 trong những bãi biển quyết rũ nhất hành tinh, mua sắm tại siêu thị đặc sản miền Trung.\r\nQuý khách dùng cơm trưa tại nhà hàng.\r\n \r\nBuổi chiều: Xe đưa đoàn ra sân bay Đà Nẵng làm thủ tục đáp chuyến bay về lại Tp.HCM. Đến sân bay Tân Sơn Nhất, xe và HDV đưa đoàn về lại điểm đón ban đầu. Kết thúc chương trình tham quan, chia tay và hẹn gặp lại Quý khách.', 'TP. Hồ Chí Minh', 'NGÀY 05: ĐÀ NẴNG – SƠN TRÀ – TP.HCM', 'Ăn Sáng – Trưa', '9ffed273-7a90-c217-da64-4e97bb73a1ab', NULL, 'Destinations', '48a55ac2-ffe3-79a5-2f47-4e3249d0fb35'),
('52ac0f29-e720-614e-3897-4eaa212efcac', 0, '2011-12-05 01:28:17', 'Quý khách nghỉ đêm trên máy bay.', 'TP. Hồ Chí Minh', 'NGÀY 1: VIỆT NAM - PARIS', 'Đêm', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '48a55ac2-ffe3-79a5-2f47-4e3249d0fb35'),
('34e8100a-65d2-c171-0d18-4ecc6baf7330', 0, '2011-12-05 01:28:17', 'Đến sân bay Charles de Gaulle, xe đón và đưa đoàn đi tham quan:\r\n●       Nhà thờ Sacre Coeur nằm trên đỉnh đồi Montre Martre\r\n●       Nhà thờ Đức Bà Paris – Notre Dame de Paris - được khởi công xây dựng vào năm 1163, hoàn tất vào năm 1345. “Notre Dame de Paris” được biết đến qua tác phẩm “Thằng Gù nhà thờ Đức Bà” của đại văn hào Victor Hugo.\r\nSau bữa trưa, đoàn tiếp tục tham quan:\r\n●       Chụp hình tại Khải Hoàn Môn - L’arc de Triomphe của Paris được xây dựng vào năm 1806 để chào mừng chiến thắng, một trong những đài tưởng niệm chiến sĩ lớn nhất Thế Giới.\r\n●       Tháp Eiffel (tầng 2) – một trong những biểu tượng chính của Paris được xây dựng vào năm 1887, cao 320 mét và là một trong những kỳ quan sáng tạo của con người trong thế kỷ 19.\r\n●       Du thuyền trên dòng sông Seine thơ mộng ngắm nhìn thành phố Paris.\r\nSau bữa tối, đoàn về khách sạn nghỉ ngơi.', 'PARIS', 'NGÀY 2: PARIS', 'Ăn Trưa – Tối', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '76c3b79b-2711-baea-e30f-4eaa29f02550'),
('9619bcf3-6ec3-5130-2686-4ed36339eea9', 0, '2011-12-05 01:28:17', 'Đến sân bay Tân Sơn Nhất, kết thúc chuyến tham quan.', 'TP. Hồ Chí Minh', 'NGÀY 12: VIỆT NAM', NULL, '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '57f7f34f-17fe-d0bd-fd0a-4ed36128258e'),
('9aacbc8a-9e8c-26dc-dd50-4ed363d7b35d', 0, '2011-12-05 01:28:17', 'Sau khi dùng điểm tâm, đoàn tự do cho đến giờ ra sân bay đáp chuyến bay về Việt Nam.', 'TP. Hồ Chí Minh', 'NGÀY 11: ROME – VIỆT NAM', 'Ăn Sáng', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '57f7f34f-17fe-d0bd-fd0a-4ed36128258e'),
('9ec7ac43-c6cc-07ee-786e-4ed36338cbd0', 0, '2011-12-05 01:28:17', 'Dùng điểm tâm, xe đưa đoàn đi tham quan:\r\n●       Thánh đường Đức Bà Cả - St. Mary Major’s Basilica tòa Thánh đường cổ được xây dựng từ thế kỷ thứ XIII để tôn vinh Thánh nữ đồng trinh Maria, và là thánh đường duy nhất ở Rome còn dữ được những điểm kiến trúc cốt lõi nguyên thủy.\r\n●       Nhà thờ Thánh Gioan thành Laterano (nếu còn thời gian) được mệnh danh là “Nhà thờ Mẹ” của người Công giáo trên toàn thế giới.\r\n●       Cầu thang Thánh – Scala Santa Monument, bậc thang Chúa Giêsu đã đặt dấu chân lên khi đến gặp tổng trấn Philatô được bà thánh Hê lê na đem từ Israel về.   \r\n●       Nhà thờ Thánh Phaolo Ngoại Thành, đây là một trong 4 thánh đường cổ quan trọng nhất thành Rome được Đại đế Constantin cho xây dựng trên nơi chôn cất Thánh Phaolo.\r\nĂn trưa. Qúy khách tự do tham quan và mua sắm tại các trung tâm thương mại.\r\nĐoàn ăn tối và về khách sạn nghỉ ngơi.', 'Rome', 'NGÀY 10: ROME', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '57f7f34f-17fe-d0bd-fd0a-4ed36128258e'),
('a2ec4730-5820-4b13-d5b5-4ed3637940a7', 0, '2011-12-05 01:28:17', 'Sau khi ăn sáng tại khách sạn, Quý khách viếng thăm:\r\n●       Tòa Thánh Vatican hay còn gọi Nhà thờ Thánh Phê rô – The Saint Peter’s Basilica – được xây dựng hoàn tất từ năm 1735.\r\n●       Bảo tàng Vatican, nhà nguyện Sistine\r\nĐoàn dùng bữa trưa và tiếp tục tham quan:\r\n●       The Roman Forum (bên ngoài) – khu vực trung tâm của người Roma cổ phát triển, nằm giữa ngọn đồi Palatine và Capitoline của thành phố Rome.\r\n●       Nhà thờ Pantheon.\r\n●       Đấu trường La Mã – The Colosseum – đấu trường hình ê-lip là một trong 7 kỳ quan của thế giới cổ đại – công trình được bắt đầu xây dựng từ những năm 70 - 72 sau CN.\r\n●       Đài phun nước Trevi Fountain.\r\nĂn tối và về khách sạn nghỉ ngơi.', 'Rome', 'NGÀY 9: ROME', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '57f7f34f-17fe-d0bd-fd0a-4ed36128258e'),
('a787d184-a9c4-5a21-5f7f-4ed363a0bf73', 0, '2011-12-05 01:28:17', 'Ăn sáng tại khách sạn, trả phòng. Đoàn khởi hành đi Lisbon. Đến Lisbon, ăn trưa. Sau đó, đoàn ra sân bay đáp chuyến bay đi Rome. Đến Rome, Quý khách ăn tối và nhận phòng khách sạn nghỉ ngơi.', 'Rome', 'NGÀY 8: FATIMA – LISBON – ROME', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '57f7f34f-17fe-d0bd-fd0a-4ed36128258e'),
('aba9a032-592e-615d-5a29-4ed3634f2800', 0, '2011-12-05 01:28:17', 'Đến Fatima, Quý khách tham quan:\r\n●       Nhà thờ Our Lady, viếng nhà nguyện “Đức Mẹ hiện ra” (không được phép vào khi đang làm lễ)\r\n●       Nhà thờ Perpetual Adoration, Capela Lausperene\r\n●       Route station of the cross (via sacra) – Chặng đàng Thánh giá Chúa\r\n●       Candlelight procession – Tham gia hành trình thấp nến cầu nguyện cùng các phái đoàn\r\nSau bữa tối, về khách sạn nhận phòng nghỉ ngơi.', 'Fatima', 'NGÀY 7: FATIMA', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '70f7a052-31c6-68b2-0367-4ed360f97740'),
('afd5c0ff-3f2f-4ebf-35f3-4ed363e24422', 0, '2011-12-05 01:28:17', 'Dùng điểm tâm, trả phòng. Qúy khách tham quan: \r\n●       Thánh đường Hoa Hồng (Vương Cung Thánh Đường Đức Mẹ Mân Côi) – Rosary Basilica - được thiết kế bởi Leopold Hardy vào năm 1899 và có sức chứa hơn 1.500 con chiên vào mỗi buổi lễ.\r\nĂn trưa. Xe đưa đoàn ra ga Irun đi Fatima. Nghỉ đêm trên tàu.', 'Fatima', 'NGÀY 6: LOURDES – IRUN – FATIMA', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '70f7a052-31c6-68b2-0367-4ed360f97740'),
('b3c5fdb1-857c-6b26-0cd7-4ed363b11c55', 0, '2011-12-05 01:28:17', 'Sau khi ăn sáng, đoàn tham quan:\r\n●       Nhà thờ hầm mang tên đức giáo hoàng Piô thứ mười với sức chứa 20.000 người.\r\n●        Vương Cung Thánh Ðường Đức Mẹ Vô Nhiễm Nguyên Tội – Basilica of the Immaculate Conception - toạ lạc ở đỉnh núi, ngay phía sau hang Massabielle và phía trên Vương Cung Thánh Ðường Ðức Mẹ Mân Côi, vì thế còn được gọi là Nhà Thờ Thượng.\r\n●       Thăm hang hiện hình – Grottes de L’apparition hay còn được gọi là Grotte Massabielle – hang động được tương truyền là Đức Mẹ hiện ra với thánh nữ Bernadette.\r\nĂn trưa. Đoàn tiếp tục tham quan:\r\n●       Nhà thờ Sacre Coeur nơi Thánh nữ Bernadette được làm phép rửa tội.\r\nĂn tối và về khách sạn nghỉ ngơi.', 'Lourdes', 'NGÀY 5: LOURDES', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', 'd2927015-3f30-adc8-73ad-4ed3608bf943'),
('b8365708-dfe0-eb5a-1ae8-4ed3632d0ff3', 0, '2011-12-05 01:28:17', 'Ăn sáng tại khách sạn, trả phòng. Xe đưa đoàn đi tham quan:\r\n●       Nhà thờ Miraculous Medal – nơi Đức Mẹ đồng trinh Mary đã hiện ra với Thánh nữ Catherine Laboure năm 1830 và tu viện nơi Thánh nữ Catherine Laboure được chôn cất. Và trái tim của Thánh Vincent de Paul cũng được lưu giữ tại đây.\r\n●       Tiếp tục viếng Eglise Saint Marie Madeleine, Nhà thờ Thánh Sulpice.\r\nĂn trưa. Xe đưa đoàn ra ga đáp chuyến tàu TGV đi Lourdes.\r\nĐến Lourdes, ăn tối, về khách sạn nhận phòng nghỉ ngơi.', 'Lourdes', 'NGÀY 4: PARIS – LOURDES', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', 'd2927015-3f30-adc8-73ad-4ed3608bf943'),
('bcefa878-ea31-b23b-20d9-4ed363b9ce41', 0, '2011-12-05 01:28:17', 'Dùng điểm tâm tại khách sạn, khởi hành đi Lisieux tham quan:\r\n●       Carmelite Couvent Chapel với mộ của Thánh nữ Teresa\r\nQuý khách dùng cơm trưa, sau đó tiếp tục tham quan:\r\n●       Nhà thờ Thánh Pierre - nhà thờ được thiết kế theo cấu trúc Gô Tích cổ điển. Trong nhà thờ này có mộ của Giám Mục Pierre, người đã tham gia trong vụ án thánh Janne D’Arc.\r\n●       Buissonnets – Đan viện Cát Minh: ngôi nhà thời thơ ấu của thánh nữ Têrêxa.\r\nẮn tối, về khách sạn nghỉ ngơi.', 'PARIS', 'NGÀY 3: PARIS - LISIEUX – PARIS', 'Ăn Sáng – Trưa – Chiều', '240d1f4f-e158-5939-9623-4eaa2183e2d7', NULL, 'Destinations', '76c3b79b-2711-baea-e30f-4eaa29f02550'),
