('7eb7ea2a-aa36-17a4-2c95-4edc213a52bf', 0, '2011-12-05 03:37:20', 'Buổi sáng: Quý khách dùng điểm tâm tại khách sạn, sau đó làm thủ tục trả phòng và khởi hành về lại Tp.HCM. Trên đường về, đoàn ghé nghỉ ngơi và mua sắm đặc sản tại Phan Rang – Ninh Thuận: nho tươi, rượu nho, mật nho, tỏi,… Tiếp tục hành trình về đến Phan Thiết. Đoàn dùng cơm trưa tại Phan Thiết.\r\n \r\nBuổi chiều: Xe đưa Quý khách về điểm đón ban đầu, kết thúc chương trình tham quan. HDV chào tạm biệt và hẹn gặp lại Quý khách.', 'TP. Hồ Chí Minh', 'NGÀY 04: NHA TRANG – TP.HCM', 'Ăn Sáng – Trưa', '8666e4e2-c0ff-834b-ebf3-4ed5a55a30f2', NULL, 'Destinations', '48a55ac2-ffe3-79a5-2f47-4e3249d0fb35'),
('78f1cf2c-1161-d0ae-8cbd-4edc210e5710', 0, '2011-12-05 03:37:20', 'Buổi sáng: Quý khách dùng điểm tâm, sau đó khởi hành đi tham quan KDL Dốc Lết – một trong những bãi biển tuyệt đẹp của Khánh Hòa. Du khách tự do tắm biển và tham gia các trò chơi trên biển: mô tô nước, chèo thuyền, dù lượn,… và thưởng thức hương vị thơm lừng của các món ăn được chế biến từ hải sản tươi sống (chi phí tự túc). Đoàn nghỉ trưa và dùng cơm tại nhà hàng.\r\n \r\nBuổi chiều: Quý khách khởi hành về lại Nha Trang. Trên đường về, đoàn ghé tham quan trung tâm du lịch suối khoáng nóng Tháp Bà với dịch vụ “Ôn tuyển thủy liệu pháp”, ngâm nước khoáng nóng, tắm bùn,… Sau đó, đoàn viếng tháp Bà Ponagar, một công trình kiến trúc của người Chăm cổ, thưởng ngoạn các thắng cảnh nổi tiếng của Thành phố Nha Trang: cầu Xóm Bóng, cầu Hà Ra, núi Cô Tiên, Hòn Chồng,…\r\n \r\nBuổi tối: Quý khách dùng bữa tối tại nhà hàng. Tự do dạo phố biển và tham quan, mua sắm tại chợ đêm Nha Trang.', 'Dốc Lết', 'NGÀY 03: DỐC LẾT – SUỐI KHOÁNG NÓNG THÁP BÀ', 'Ăn Sáng – Trưa – Chiều', '8666e4e2-c0ff-834b-ebf3-4ed5a55a30f2', NULL, 'Locations', '56de1c4d-fb00-b758-3a75-4ed35eaa04e8'),
('6ed982fd-b411-4126-b9c8-4edc2137708c', 0, '2011-12-05 03:37:20', 'Buổi sáng: Sau khi dùng điểm tâm tại khách sạn, xe đưa đoàn tham quan vịnh Nha Trang – một trong 29 vịnh biển đẹp nhất thế giới. Du khách thỏa sức ngắm cảnh làng chài, bãi sạn, hòn Tằm, hòn Tre... Đoàn tiếp tục đến với khu vui chơi giải trí 4* Diamond Bay để tắm biển và chơi các trò chơi trên biển: mô tô nước, dù bay, lướt ván, cuồng thể thao, thuyền chuối... tại bãi tắm Nhũ Tiên. Sau đó, đoàn tham quan khu vui chơi giải trí Wonder Land (Sông Lô) – nơi diễn ra cuộc thi hoa hậu Hoàn Vũ năm 2008.\r\nQuý khách nghỉ trưa và dùng bữa tại nhà hàng.\r\nBuổi chiều: Đoàn tham quan viện Hải Dương Học Nha Trang, tìm hiểu đời sống các sinh vật đại dương. Tiếp tục tham quan KDL 5* Vinpearl Land. Quý khách đi cáp treo băng biển dài hơn 3km, chơi các trò chơi cảm giác mạnh, xem biểu diễn nhạc nước, tắm biển và bơi lội tại hồ bơi lớn nhất Đông Nam Á (chi phí tự túc).\r\nBuổi tối: Quý khách dùng cơm tối tại nhà hàng. Tự do khám phá thành phố biển Nha Trang về đêm.', 'Vinpearl', 'NGÀY 02: DIAMOND BAY – VINPEARL LAND', 'Ăn Sáng – Trưa – Chiều', '8666e4e2-c0ff-834b-ebf3-4ed5a55a30f2', 'vinpearl_2.jpg', 'Locations', 'dc0c0888-c823-ac37-00fa-4e9e3f8615f0'),
('b0428a9c-3a04-5fb0-428c-4ed5a56138f4', 0, '2011-12-05 03:37:20', 'Buổi sáng: Xe và HDV Carnival Tours đón Quý khách khởi hành đi Nha Trang. Đoàn dừng lại ăn sáng tại nhà hàng trước khi tiếp tục chuyến hành trình trên QL.1A đi qua các địa danh nổi tiếng: Vựa trái cây Long Khánh – Đồng Nai, thắng cảnh chùa núi Tà Kú, vườn Thanh long trĩu quả Hàm Thuận Nam – Bình Thuận.\r\nQuý khách đến Phan Thiết nghỉ ngơi, ăn trưa. Trên đường đi, đoàn dừng chân ở Cà Nà – một trong những bãi biển đẹp nhất của miền Trung, chụp hình lưu niệm.\r\n \r\nBuổi chiều: Đến Cam Ranh, xe đưa Quý khách vào Nha Trang theo cung đường mới Sông Lô – Hòn Rớ với bãi Dài hoang sơ, hệ thống resort Diamond Bay với sân golf Quốc tế, KDL Hoàn Cầu với tòa nhà hội nghị Diamond Bay – nơi tổ chức đêm chung kết hoa hậu Hoàn Vũ và các cuộc thi sắc đẹp khác của Việt Nam.\r\n \r\nBuổi tối: Đoàn đến Nha Trang. Quý khách dùng bữa tối tại nhà hàng và nhận phòng khách sạn. Quý khách tự do dạo phố biển về đêm.', 'Nha Trang', 'NGÀY 01: TP.HCM – NHA TRANG', 'Ăn Sáng – Trưa – Chiều', '8666e4e2-c0ff-834b-ebf3-4ed5a55a30f2', NULL, 'Destinations', 'ccca8ddb-c2bb-8274-e3f4-4e9e3b90a134');
